espaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>\n','ezxmltext',228,'eng-GB',3,0,'',1),(229,158,60,0,1,'','ezboolean',229,'eng-GB',3,1,'',1),(0,307,60,0,NULL,'<?xml version=\"1.0\"?>\n<page>\n  <zone_layout>CallForActionLayout</zone_layout>\n  <zone id=\"id_c677dd3471c768ac30d2ccf56629a128\">\n    <zone_identifier>main</zone_identifier>\n  </zone>\n</page>\n','ezpage',230,'eng-GB',3,0,'',1),(0,308,60,0,NULL,'','ezkeyword',231,'eng-GB',3,0,'',1),(0,4,61,0,NULL,'Beers','ezstring',232,'eng-GB',3,0,'beers',1),(0,155,61,0,NULL,'','ezstring',233,'eng-GB',3,0,'',1),(0,119,61,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>\n','ezxmltext',234,'eng-GB',3,0,'',1),(0,156,61,0,1045487555,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"/>\n','ezxmltext',235,'eng-GB',3,0,'',1),(236,158,61,0,1,'','ezboolean',236,'eng-GB',3,1,'',1),(0,308,61,0,NULL,'','ezkeyword',237,'eng-GB',3,0,'',1),(0,325,62,NULL,NULL,'Flute','ezstring',238,'eng-GB',2,0,'flute',1),(0,325,63,NULL,NULL,'Goblet','ezstring',239,'eng-GB',2,0,'goblet',1),(0,325,64,NULL,NULL,'Mug','ezstring',240,'eng-GB',2,0,'mug',1),(0,325,65,NULL,NULL,'Pilsner','ezstring',241,'eng-GB',2,0,'pilsner',1),(0,325,66,NULL,NULL,'Pint','ezstring',242,'eng-GB',2,0,'pint',1),(0,325,67,NULL,NULL,'Snifter','ezstring',243,'eng-GB',2,0,'snifter',1),(0,325,68,NULL,NULL,'Stange','ezstring',244,'eng-GB',2,0,'stange',1),(0,325,69,NULL,NULL,'Tulip','ezstring',245,'eng-GB',2,0,'tulip',1),(0,325,70,NULL,NULL,'Weizen','ezstring',246,'eng-GB',2,0,'weizen',1),(0,325,71,NULL,NULL,'Oversized Wine Glass','ezstring',247,'eng-GB',2,0,'oversized wine glass',1),(0,325,72,NULL,NULL,'Willi','ezstring',248,'eng-GB',2,0,'willi',1),(0,325,73,NULL,NULL,'Thistle','ezstring',249,'eng-GB',2,0,'thistle',1),(0,318,74,NULL,NULL,'British Origin Ales','ezstring',250,'eng-GB',2,0,'british origin ales',1),(0,319,75,NULL,NULL,'Classic English-Style Pale Ale','ezstring',251,'eng-GB',2,0,'classic english-style pale ale',1),(0,320,75,NULL,NULL,'Classic English pale ales are golden to copper colored and display earthy, herbal English-variety hop character. Note that \"earthy, herbal English-variety hop character\" is the perceived end, but may be a result of the skillful use of hops of other national origins. Medium to high hop bitterness, flavor, and aroma should be evident. This medium-bodied pale ale has low to medium malt flavor and aroma. Low caramel character is allowable. Fruity-ester flavors and aromas are moderate to strong. Chill haze may be in evidence only at very cold temperatures. The absence of diacetyl is desirable, though, diacetyl (butterscotch character) is acceptable and characteristic when at very low levels.','eztext',252,'eng-GB',2,0,'',1),(0,321,75,NULL,20,NULL,'ezinteger',253,'eng-GB',2,20,'',1),(0,322,75,NULL,40,NULL,'ezinteger',254,'eng-GB',2,40,'',1),(0,323,75,4,NULL,NULL,'ezfloat',255,'eng-GB',2,0,'',1),(0,324,75,5,NULL,NULL,'ezfloat',256,'eng-GB',2,0,'',1),(0,319,76,NULL,NULL,'English-Style India Pale Ale','ezstring',257,'eng-GB',2,0,'english-style india pale ale',1),(0,320,76,NULL,NULL,'Most traditional interpretations of English-style India pale ales are characterized by medium-high hop bitterness with a medium to medium-high alcohol content. Hops from a variety of origins may be used to contribute to a high hopping rate. Earthy and herbal English-variety hop character is the perceived end, but may be a result of the skillful use of hops of other national origins. The use of water with high mineral content results in a crisp, dry beer, sometimes with subtle and balanced character of sulfur compounds. This pale gold to deep copper-colored ale has a medium to high, flowery hop aroma and may have a medium to strong hop flavor (in addition to the hop bitterness). English-style India pale ales possess medium maltiness and body. Fruity-ester flavors and aromas are moderate to very strong. Diacetyl can be absent or may be perceived at very low levels. Chill haze is allowable at cold temperatures. Hops of other origins may be used for bitterness or approximating traditional English character.','eztext',258,'eng-GB',2,0,'',1),(0,321,76,NULL,35,NULL,'ezinteger',259,'eng-GB',2,35,'',1),(0,322,76,NULL,63,NULL,'ezinteger',260,'eng-GB',2,63,'',1),(0,323,76,5,NULL,NULL,'ezfloat',261,'eng-GB',2,0,'',1),(0,324,76,7,NULL,NULL,'ezfloat',262,'eng-GB',2,0,'',1),(0,319,77,NULL,NULL,'Ordinary Bitter','ezstring',263,'eng-GB',2,0,'ordinary bitter',1),(0,320,77,NULL,NULL,'Ordinary bitter is gold to copper colored with medium bitterness, light to medium body, and low to medium residual malt sweetness. Hop flavor and aroma character may be evident at the brewer\'s discretion. Mild carbonation traditionally characterizes draft-cask versions, but in bottled versions, a slight increase in carbon dioxide content is acceptable. Fruity-ester character and very low diacetyl (butterscotch) character are acceptable in aroma and flavor, but should be minimized in this form of bitter. Chill haze is allowable at cold temperatures. (English and American hop character may be specified in subcategories.)','eztext',264,'eng-GB',2,0,'',1),(0,321,77,NULL,20,NULL,'ezinteger',265,'eng-GB',2,20,'',1),(0,322,77,NULL,35,NULL,'ezinteger',266,'eng-GB',2,35,'',1),(0,323,77,3,NULL,NULL,'ezfloat',267,'eng-GB',2,0,'',1),(0,324,77,4,NULL,NULL,'ezfloat',268,'eng-GB',2,0,'',1),(0,319,78,NULL,NULL,'Special Bitter or Best Bitter','ezstring',269,'eng-GB',2,0,'special bitter or best bitter',1),(0,320,78,NULL,NULL,'Special bitter is more robust than ordinary bitter. It has medium body and medium residual malt sweetness. It is deep gold to copper colored. Hop bitterness should be medium and absent of harshness. Hop flavor and aroma character may be evident at the brewer\'s discretion. Mild carbonation traditionally characterizes draft-cask versions, but in bottled versions, a slight increase in carbon dioxide content is acceptable. Fruity-ester character is acceptable in aroma and flavor. Diacetyl (butterscotch character) is acceptable and characteristic when at very low levels. The absence of diacetyl is also acceptable. Chill haze is allowable at cold temperatures. (English and American hop character may be specified in subcategories.)','eztext',270,'eng-GB',2,0,'',1),(0,321,78,NULL,28,NULL,'ezinteger',271,'eng-GB',2,28,'',1),(0,322,78,NULL,40,NULL,'ezinteger',272,'eng-GB',2,40,'',1),(0,323,78,4,NULL,NULL,'ezfloat',273,'eng-GB',2,0,'',1),(0,324,78,4,NULL,NULL,'ezfloat',274,'eng-GB',2,0,'',1),(0,319,79,NULL,NULL,'Extra Special Bitter','ezstring',275,'eng-GB',2,0,'extra special bitter',1),(0,320,79,NULL,NULL,'Extra special bitter possesses medium to strong hop aroma, flavor, and bitterness. The residual malt and defining sweetness of this richly flavored, full-bodied bitter is more pronounced than in other styles of bitter. It is light amber to copper colored with medium to medium-high bitterness. Mild carbonation traditionally characterizes draft-cask versions, but in bottled versions, a slight increase in carbon dioxide content is acceptable. Fruity-ester character is acceptable in aroma and flavor. Diacetyl (butterscotch character) is acceptable and characteristic when at very low levels. The absence of diacetyl is also acceptable. Chill haze is allowable at cold temperatures. English or American hops may be used. (English and American hop character may be specified in subcategories.)','eztext',276,'eng-GB',2,0,'',1),(0,321,79,NULL,30,NULL,'ezinteger',277,'eng-GB',2,30,'',1),(0,322,79,NULL,45,NULL,'ezinteger',278,'eng-GB',2,45,'',1),(0,323,79,4,NULL,NULL,'ezfloat',279,'eng-GB',2,0,'',1),(0,324,79,5,NULL,NULL,'ezfloat',280,'eng-GB',2,0,'',1),(0,319,80,NULL,NULL,'English-Style Summer Ale','ezstring',281,'eng-GB',2,0,'english-style summer ale',1),(0,320,80,NULL,NULL,'English Summer Ale is light straw to golden colored with medium-low to medium bitterness, light to medium-light body, and low to medium residual malt sweetness. Torrefied and/or malted wheat are often used in quantities of 25% or less. Malt flavor may be biscuit-like. English, American or Noble-type hop, character, flavor and aroma are evident and may or may not be assertive yet always well balanced with malt character. Mild carbonation traditionally characterizes draft-cask versions. In bottled versions, normal or lively carbon dioxide content is appropriate. The overall impression is refreshing and thirst quenching. Fruity-ester characters are acceptable at low to moderate levels. No butterscotch-like diacetyl or sweet corn-like dimethylsulfide (DMS) should be apparent in aroma or flavor. Chill haze is allowable at cold temperatures.','eztext',282,'eng-GB',2,0,'',1),(0,321,80,NULL,20,NULL,'ezinteger',283,'eng-GB',2,20,'',1),(0,322,80,NULL,30,NULL,'ezinteger',284,'eng-GB',2,30,'',1),(0,323,80,3,NULL,NULL,'ezfloat',285,'eng-GB',2,0,'',1),(0,324,80,5,NULL,NULL,'ezfloat',286,'eng-GB',2,0,'',1),(0,319,81,NULL,NULL,'Scottish-Style Light Ale','ezstring',287,'eng-GB',2,0,'scottish-style light ale',1),(0,320,81,NULL,NULL,'Scottish light ales are light bodied. Little bitterness is perceived, and hop flavor or aroma should not be perceived. Despite its lightness, Scottish light ale will have a degree of malty, caramel-like, soft and chewy character. Yeast characters such as diacetyl (butterscotch) and sulfuriness are acceptable at very low levels. The color will range from golden amber to deep brown Bottled versions of this traditional draft beer may contain higher amounts of carbon dioxide than is typical for mildly carbonated draft versions. Chill haze is acceptable at low temperatures. Though there is little evidence suggesting that traditionally made Scottishstyle light ales exhibited peat smoke character, the current marketplace offers many Scottish-style light ales with peat or smoke character present at low to medium levels. Thus a peaty/smoky character may be evident at low levels (ales with medium or higher smoke character would be considered a smoke flavored beer and considered in another category). Scottish-style light ales may be split into two subcategories: Traditional (no smoke character) and Peated (low level of peat smoke character).','eztext',288,'eng-GB',2,0,'',1),(0,321,81,NULL,9,NULL,'ezinteger',289,'eng-GB',2,9,'',1),(0,322,81,NULL,20,NULL,'ezinteger',290,'eng-GB',2,20,'',1),(0,323,81,2,NULL,NULL,'ezfloat',291,'eng-GB',2,0,'',1),(0,324,81,3,NULL,NULL,'ezfloat',292,'eng-GB',2,0,'',1),(0,319,82,NULL,NULL,'Scottish-Style Heavy Ale','ezstring',293,'eng-GB',2,0,'scottish-style heavy ale',1),(0,320,82,NULL,NULL,'Scottish heavy ale is moderate in strength and dominated by a smooth, sweet maltiness balanced with low, but perceptible, hop bitterness. Hop flavor or aroma should not be perceived. Scottish heavy ale will have a medium degree of malty, caramel-like, soft and chewy character in flavor and mouthfeel. It has medium body, and fruity esters are very low, if evident. Yeast characters such as diacetyl (butterscotch) and sulfuriness are acceptable at very low levels. The color will range from golden amber to deep brown. Bottled versions of this traditional draft beer may contain higher amounts of carbon dioxide than is typical for mildly carbonated draft versions. Chill haze is acceptable at low temperatures. Though there is little evidence suggesting that traditionally made Scottish-style heavy ales exhibited peat smoke character, the current marketplace offers many Scottish-style heavy ales with peat or smoke character present at low to medium levels. Thus a peaty/smoky character may be evident at low to medium levels (ales with medium-high or higher smoke character would be considered a smoke flavored beer and considered in another category). Scottish-style heavy ales may be split into two subcategories: Traditional (no smoke character) and Peated (low level of peat smoke character).','eztext',294,'eng-GB',2,0,'',1),(0,321,82,NULL,12,NULL,'ezinteger',295,'eng-GB',2,12,'',1),(0,322,82,NULL,20,NULL,'ezinteger',296,'eng-GB',2,20,'',1),(0,323,82,3,NULL,NULL,'ezfloat',297,'eng-GB',2,0,'',1),(0,324,82,4,NULL,NULL,'ezfloat',298,'eng-GB',2,0,'',1),(0,319,83,NULL,NULL,'Scottish-Style Export Ale','ezstring',299,'eng-GB',2,0,'scottish-style export ale',1),(0,320,83,NULL,NULL,'The overriding character of Scottish export ale is sweet, caramel-like, and malty. Its bitterness is perceived as low to medium. Hop flavor or aroma should not be perceived. It has medium body. Fruity-ester character may be apparent. Yeast characters such as diacetyl (butterscotch) and sulfuriness are acceptable at very low levels. The color will range from golden amber to deep brown. Bottled versions of this traditional draft beer may contain higher amounts of carbon dioxide than is typical for mildly carbonated draft versions. Chill haze is acceptable at low temperatures. Though there is little evidence suggesting that traditionally made Scottish-style export ales exhibited peat smoke character, the current marketplace offers many Scottish-style export ales with peat or smoke character present at low to medium levels. Thus a peaty/smoky character may be evident at low to medium levels (ales with medium-high or higher smoke character would be considered a smoke flavored beer and considered in another category). Scottish-style export ales may be split into two subcategories: Traditional (no smoke character) and Peated (low level of peat smoke character).','eztext',300,'eng-GB',2,0,'',1),(0,321,83,NULL,15,NULL,'ezinteger',301,'eng-GB',2,15,'',1),(0,322,83,NULL,25,NULL,'ezinteger',302,'eng-GB',2,25,'',1),(0,323,83,4,NULL,NULL,'ezfloat',303,'eng-GB',2,0,'',1),(0,324,83,5,NULL,NULL,'ezfloat',304,'eng-GB',2,0,'',1),(0,319,84,NULL,NULL,'English-Style Pale Mild Ale','ezstring',305,'eng-GB',2,0,'english-style pale mild ale',1),(0,320,84,NULL,NULL,'English pale mild ales range from golden to amber in color. Malt flavor dominates the flavor profile with little hop bitterness or flavor. Hop aroma can be light. Very low diacetyl flavors may be appropriate in this low-alcohol beer. Fruity-ester level is very low. Chill haze is allowable at cold temperatures.','eztext',306,'eng-GB',2,0,'',1),(0,321,84,NULL,10,NULL,'ezinteger',307,'eng-GB',2,10,'',1),(0,322,84,NULL,20,NULL,'ezinteger',308,'eng-GB',2,20,'',1),(0,323,84,3,NULL,NULL,'ezfloat',309,'eng-GB',2,0,'',1),(0,324,84,4,NULL,NULL,'ezfloat',310,'eng-GB',2,0,'',1),(0,319,85,NULL,NULL,'English-Style Dark Mild Ale','ezstring',311,'eng-GB',2,0,'english-style dark mild ale',1),(0,320,85,NULL,NULL,'English dark mild ales range from deep copper to dark brown (often with a red tint) in color. Malt flavor and caramel are part of the flavor and aroma profile while, licorice and roast malt tones may sometimes contribute to the flavor and aroma profile. Body should be low-medium to medium. These beers have very little hop flavor or aroma. Very low diacetyl flavors may be appropriate in this low-alcohol beer. Fruity-ester level is very low.','eztext',312,'eng-GB',2,0,'',1),(0,321,85,NULL,10,NULL,'ezinteger',313,'eng-GB',2,10,'',1),(0,322,85,NULL,24,NULL,'ezinteger',314,'eng-GB',2,24,'',1),(0,323,85,3,NULL,NULL,'ezfloat',315,'eng-GB',2,0,'',1),(0,324,85,4,NULL,NULL,'ezfloat',316,'eng-GB',2,0,'',1),(0,319,86,NULL,NULL,'English-Style Brown Ale','ezstring',317,'eng-GB',2,0,'english-style brown ale',1),(0,320,86,NULL,NULL,'English brown ales range from copper to brown in color. They have medium body and range from dry to sweet maltiness with very little hop flavor or aroma. Roast malt tones may sometimes contribute to the flavor and aroma profile. Low to medium-low levels of fruity-ester flavors are appropriate. Diacetyl should be very low, if evident. Chill haze is allowable at cold temperatures.','eztext',318,'eng-GB',2,0,'',1),(0,321,86,NULL,15,NULL,'ezinteger',319,'eng-GB',2,15,'',1),(0,322,86,NULL,25,NULL,'ezinteger',320,'eng-GB',2,25,'',1),(0,323,86,4,NULL,NULL,'ezfloat',321,'eng-GB',2,0,'',1),(0,324,86,5,NULL,NULL,'ezfloat',322,'eng-GB',2,0,'',1),(0,319,87,NULL,NULL,'Old Ale','ezstring',323,'eng-GB',2,0,'old ale',1),(0,320,87,NULL,NULL,'Dark amber to brown in color, old ales are medium to full bodied with a malty sweetness. Hop aroma should be minimal and flavor can vary from none to medium in character intensity. Fruity-ester flavors and aromas can contribute to the character of this ale. Bitterness should be minimal but evident and balanced with malt and/or caramel-like sweetness. Alcohol types can be varied and complex. A distinctive quality of these ales is that they undergo an aging process (often for years) on their yeast either in bulk storage or through conditioning in the bottle, which contributes to a rich, wine-like and often sweet oxidation character. Complex estery characters may also emerge. Some very low diacetyl character may be evident and acceptable. Wood aged characters such as vanillin and other woody characters are acceptable. Horsey, goaty, leathery and phenolic character evolved from Brettanomyces organisms and acidity may be present but should be at low levels and balanced with other flavors Residual flavors that come from liquids previously aged in a barrel such as bourbon or sherry should not be present. Chill haze is acceptable at low temperatures. (This style may often be split into two categories, strong and very strong. Brettanomyces organisms and acidic characters reflect historical character. Competition organizers may choose to distinguish these types of old ale from modern versions.)','eztext',324,'eng-GB',2,0,'',1),(0,321,87,NULL,30,NULL,'ezinteger',325,'eng-GB',2,30,'',1),(0,322,87,NULL,65,NULL,'ezinteger',326,'eng-GB',2,65,'',1),(0,323,87,6,NULL,NULL,'ezfloat',327,'eng-GB',2,0,'',1),(0,324,87,9,NULL,NULL,'ezfloat',328,'eng-GB',2,0,'',1),(0,319,88,NULL,NULL,'Strong Ale','ezstring',329,'eng-GB',2,0,'strong ale',1),(0,320,88,NULL,NULL,'Light amber to mid-range brown in color, strong ales are medium to full bodied with a malty sweetness and may have low levels of roast malt character. Hop aroma should be minimal and flavor can vary from none to medium in character intensity. Fruity-ester flavors and aromas can contribute to the character of this ale. Bitterness should be minimal but evident and balanced with malt and/or caramel-like sweetness. Alcohol types can be varied and complex. A rich, often sweet and complex estery character may be evident. Very low levels of diacetyl are acceptable. Chill haze is acceptable at low temperatures. (This style may often be split into two categories, strong and very strong.)','eztext',330,'eng-GB',2,0,'',1),(0,321,88,NULL,30,NULL,'ezinteger',331,'eng-GB',2,30,'',1),(0,322,88,NULL,65,NULL,'ezinteger',332,'eng-GB',2,65,'',1),(0,323,88,7,NULL,NULL,'ezfloat',333,'eng-GB',2,0,'',1),(0,324,88,11,NULL,NULL,'ezfloat',334,'eng-GB',2,0,'',1),(0,319,89,NULL,NULL,'Scotch Ale','ezstring',335,'eng-GB',2,0,'scotch ale',1),(0,320,89,NULL,NULL,'Scotch ales are overwhelmingly malty and full-bodied. Perception of hop bitterness is very low. Hop flavor and aroma are very low or nonexistent. Color ranges from deep copper to brown. The clean alcohol flavor balances the rich and dominant sweet maltiness in flavor and aroma. A caramel character is often a part of the profile. Dark roasted malt flavors and aroma may be evident at low levels. If present, fruity esters are generally at low aromatic and flavor levels. Low diacetyl levels are acceptable. Chill haze is allowable at cold temperatures. Though there is little evidence suggesting that traditionally made strong Scotch ales exhibited peat smoke character, the current marketplace offers many Scotch Ales with peat or smoke character present at low to medium levels. Thus a peaty/smoky character may be evident at low levels (ales with medium or higher smoke character would be considered a smoke flavored beer and considered in another category). Scotch Ales may be split into two subcategories: Traditional (no smoke character) and Peated (low level of peat smoke character).','eztext',336,'eng-GB',2,0,'',1),(0,321,89,NULL,25,NULL,'ezinteger',337,'eng-GB',2,25,'',1),(0,322,89,NULL,35,NULL,'ezinteger',338,'eng-GB',2,35,'',1),(0,323,89,6,NULL,NULL,'ezfloat',339,'eng-GB',2,0,'',1),(0,324,89,8,NULL,NULL,'ezfloat',340,'eng-GB',2,0,'',1),(0,319,90,NULL,NULL,'British-Style Imperial Stout','ezstring',341,'eng-GB',2,0,'british-style imperial stout',1),(0,320,90,NULL,NULL,'Dark copper to very dark brown, British-style imperial stouts typically have high alcohol content. The extremely rich malty flavor (often characterized as toffee-like or caramel-like) and aroma are balanced with medium hopping and high fruity-ester characteristics. Bitterness should be moderate and balanced with sweet malt character. The bitterness may be higher in the darker versions. Roasted malt astringency is very low or absent. Bitterness should not overwhelm the overall character. Hop aroma can be subtle to moderately hop-floral, -citrus or -herbal. Diacetyl (butterscotch) levels should be absent.','eztext',342,'eng-GB',2,0,'',1),(0,321,90,NULL,45,NULL,'ezinteger',343,'eng-GB',2,45,'',1),(0,322,90,NULL,65,NULL,'ezinteger',344,'eng-GB',2,65,'',1),(0,323,90,7,NULL,NULL,'ezfloat',345,'eng-GB',2,0,'',1),(0,324,90,12,NULL,NULL,'ezfloat',346,'eng-GB',2,0,'',1),(0,319,91,NULL,NULL,'British-Style Barley Wine Ale','ezstring',347,'eng-GB',2,0,'british-style barley wine ale',1),(0,320,91,NULL,NULL,'British-style barley wines range from tawny copper to dark brown in color and have a full body and high residual malty sweetness. Complexity of alcohols and fruity-ester characters are often high and counterbalanced by the perception of low to medium bitterness and extraordinary alcohol content. Hop aroma and flavor may be minimal to medium. English type hops are often used but not necessary for this style. Low levels of diacetyl may be acceptable. Caramel and some characters indicating oxidation, such as vinous (sometimes sherry-like) aromas and/or flavors, may be considered positive. Chill haze is allowable at cold temperatures.','eztext',348,'eng-GB',2,0,'',1),(0,321,91,NULL,40,NULL,'ezinteger',349,'eng-GB',2,40,'',1),(0,322,91,NULL,60,NULL,'ezinteger',350,'eng-GB',2,60,'',1),(0,323,91,8,NULL,NULL,'ezfloat',351,'eng-GB',2,0,'',1),(0,324,91,12,NULL,NULL,'ezfloat',352,'eng-GB',2,0,'',1),(0,319,92,NULL,NULL,'Brown Porter','ezstring',353,'eng-GB',2,0,'brown porter',1),(0,320,92,NULL,NULL,'Brown porters are mid to dark brown (may have red tint) in color. No roast barley or strong burnt/black malt character should be perceived. Low to medium malt sweetness, caramel and chocolate is acceptable along with medium hop bitterness. This is a lightto medium-bodied beer. Fruity esters are acceptable. Hop flavor and aroma may vary from being negligible to medium in character.','eztext',354,'eng-GB',2,0,'',1),(0,321,92,NULL,20,NULL,'ezinteger',355,'eng-GB',2,20,'',1),(0,322,92,NULL,30,NULL,'ezinteger',356,'eng-GB',2,30,'',1),(0,323,92,4,NULL,NULL,'ezfloat',357,'eng-GB',2,0,'',1),(0,324,92,6,NULL,NULL,'ezfloat',358,'eng-GB',2,0,'',1),(0,319,93,NULL,NULL,'Robust Porter','ezstring',359,'eng-GB',2,0,'robust porter',1),(0,320,93,NULL,NULL,'Robust porters are black in color and have a roast malt flavor, often reminiscent of cocoa, but no roast barley flavor. These porters have a sharp bitterness of black malt without a highly burnt/charcoal flavor. Caramel and other malt sweetness should be present and in harmony with other distinguishing porter characters. Robust porters range from medium to full in body and have a malty sweetness. Hop bitterness is medium to high, with hop aroma and flavor ranging from negligible to medium. Diacetyl is acceptable at very low levels. Fruity esters should be evident, balanced with roast malt and hop bitterness.','eztext',360,'eng-GB',2,0,'',1),(0,321,93,NULL,25,NULL,'ezinteger',361,'eng-GB',2,25,'',1),(0,322,93,NULL,40,NULL,'ezinteger',362,'eng-GB',2,40,'',1),(0,323,93,5,NULL,NULL,'ezfloat',363,'eng-GB',2,0,'',1),(0,324,93,6,NULL,NULL,'ezfloat',364,'eng-GB',2,0,'',1),(0,319,94,NULL,NULL,'Sweet or Cream Stout','ezstring',365,'eng-GB',2,0,'sweet or cream stout',1),(0,320,94,NULL,NULL,'Sweet stouts, also referred to as cream stouts, have less roasted bitter flavor and a full-bodied mouthfeel. The style can be given more body with milk sugar (lactose) before bottling. Malt sweetness, chocolate, and caramel flavor should dominate the flavor profile and contribute to the aroma. Hops should balance and suppress some of the sweetness without contributing apparent flavor or aroma. The overall impression should be sweet and full-bodied.','eztext',366,'eng-GB',2,0,'',1),(0,321,94,NULL,15,NULL,'ezinteger',367,'eng-GB',2,15,'',1),(0,322,94,NULL,25,NULL,'ezinteger',368,'eng-GB',2,25,'',1),(0,323,94,3,NULL,NULL,'ezfloat',369,'eng-GB',2,0,'',1),(0,324,94,6,NULL,NULL,'ezfloat',370,'eng-GB',2,0,'',1),(0,319,95,NULL,NULL,'Oatmeal Stout','ezstring',371,'eng-GB',2,0,'oatmeal stout',1),(0,320,95,NULL,NULL,'Oatmeal stouts include oatmeal in their grist, resulting in a pleasant, full flavor and a smooth profile that is rich without being grainy. A roasted malt character which is caramel-like and chocolate-like should be evident - smooth and not bitter. Coffee-like roasted barley and roasted malt aromas (chocolate and nut-like) are prominent. Color is dark brown to black. Bitterness is moderate, not high. Hop flavor and aroma are optional but should not overpower the overall balance if present. This is a medium- to full- bodied beer, with minimal fruity esters. Diacetyl should be absent or at extremely low levels. Original gravity range and alcohol levels are indicative of English tradition of oatmeal stout.','eztext',372,'eng-GB',2,0,'',1),(0,321,95,NULL,20,NULL,'ezinteger',373,'eng-GB',2,20,'',1),(0,322,95,NULL,40,NULL,'ezinteger',374,'eng-GB',2,40,'',1),(0,323,95,3,NULL,NULL,'ezfloat',375,'eng-GB',2,0,'',1),(0,324,95,6,NULL,NULL,'ezfloat',376,'eng-GB',2,0,'',1),(0,318,96,NULL,NULL,'Irish Origin Ales','ezstring',377,'eng-GB',2,0,'irish origin ales',1),(0,319,97,NULL,NULL,'Irish-Style Red Ale','ezstring',378,'eng-GB',2,0,'irish-style red ale',1),(0,320,97,NULL,NULL,'Irish-style red ales range from light red-amber-copper to light brown in color. These ales have a medium hop bitterness and flavor. They often don\'t have hop aroma. Irish-style red ales have low to medium candy-like caramel malt sweetness and may have a balanced subtle degree of roast barley or roast malt character and complexity.  Irish-style Red Ales have a medium body. The style may have low levels of fruity-ester flavor and aroma. Diacetyl should be absent or at very low levels. Chill haze is allowable at cold temperatures. Slight yeast haze is acceptable for bottle-conditioned products.','eztext',379,'eng-GB',2,0,'',1),(0,321,97,NULL,20,NULL,'ezinteger',380,'eng-GB',2,20,'',1),(0,322,97,NULL,28,NULL,'ezinteger',381,'eng-GB',2,28,'',1),(0,323,97,4,NULL,NULL,'ezfloat',382,'eng-GB',2,0,'',1),(0,324,97,4,NULL,NULL,'ezfloat',383,'eng-GB',2,0,'',1),(0,319,98,NULL,NULL,'Classic Irish-Style Dry Stout','ezstring',384,'eng-GB',2,0,'classic irish-style dry stout',1),(0,320,98,NULL,NULL,'Dry stouts have an initial malt and light caramel flavor profile with a distinctive dry-roasted bitterness in the finish. Dry stouts achieve a dry-roasted character through the use of roasted barley. The emphasis of coffee-like roasted barley and a moderate degree of roasted malt aromas define much of the character. Some slight acidity may be perceived but is not necessary. European hop aroma and flavor should be low or not perceived. Dry stouts have medium-light to medium body. Fruity esters are minimal and overshadowed by malt, high hop bitterness, and roasted barley character. Diacetyl (butterscotch) should be very low or not perceived. Head retention and rich character should be part of its visual character.','eztext',385,'eng-GB',2,0,'',1),(0,321,98,NULL,30,NULL,'ezinteger',386,'eng-GB',2,30,'',1),(0,322,98,NULL,40,NULL,'ezinteger',387,'eng-GB',2,40,'',1),(0,323,98,3,NULL,NULL,'ezfloat',388,'eng-GB',2,0,'',1),(0,324,98,5,NULL,NULL,'ezfloat',389,'eng-GB',2,0,'',1),(0,319,99,NULL,NULL,'Foreign (Export)-Style Stout','ezstring',390,'eng-GB',2,0,'foreign (export)-style stout',1),(0,320,99,NULL,NULL,'As with classic dry stouts, foreign-style stouts have an initial malt sweetness and caramel flavor with a distinctive dry-roasted bitterness in the finish. Coffee-like roasted barley and roasted malt aromas are prominent. Some slight acidity is permissible and a medium- to full-bodied mouthfeel is appropriate. Bitterness may be high but the perception is often compromised by malt sweetness. Hop aroma and flavor should not be perceived. The perception of fruity esters is low. Diacetyl (butterscotch) should be negligible or not perceived. Head retention is excellent.','eztext',391,'eng-GB',2,0,'',1),(0,321,99,NULL,30,NULL,'ezinteger',392,'eng-GB',2,30,'',1),(0,322,99,NULL,60,NULL,'ezinteger',393,'eng-GB',2,60,'',1),(0,323,99,5,NULL,NULL,'ezfloat',394,'eng-GB',2,0,'',1),(0,324,99,9,NULL,NULL,'ezfloat',395,'eng-GB',2,0,'',1),(0,318,100,NULL,NULL,'North American Origin Ales','ezstring',396,'eng-GB',2,0,'north american origin ales',1),(0,319,101,NULL,NULL,'American-Style Pale Ale','ezstring',397,'eng-GB',2,0,'american-style pale ale',1),(0,320,101,NULL,NULL,'American pale ales range from deep golden to copper in color. The style is characterized by fruity, floral and citrus-like American-variety hop character producing medium to medium-high hop bitterness, flavor, and aroma. Note that the \"traditional\" style of this beer has its origins with certain floral, fruity, citrus-like, piney, resinous, or sulfur-like American hop varietals. One or more of these hop characters is the perceived end, but the perceived hop characters may be a result of the skillful use of hops of other national origins. American pale ales have medium body and low to medium maltiness. Low caramel character is allowable. Fruity-ester flavor and aroma should be moderate to strong. Diacetyl should be absent or present at very low levels. Chill haze is allowable at cold temperatures.','eztext',398,'eng-GB',2,0,'',1),(0,321,101,NULL,30,NULL,'ezinteger',399,'eng-GB',2,30,'',1),(0,322,101,NULL,42,NULL,'ezinteger',400,'eng-GB',2,42,'',1),(0,323,101,4,NULL,NULL,'ezfloat',401,'eng-GB',2,0,'',1),(0,324,101,5,NULL,NULL,'ezfloat',402,'eng-GB',2,0,'',1),(0,319,102,NULL,NULL,'Fresh \"Wet\" Hop Ale','ezstring',403,'eng-GB',2,0,'fresh \"wet\" hop ale',1),(0,320,102,NULL,NULL,'Any style of ale can be made into a fresh hop or wet hop version. These ales are hopped predominantly with fresh (newly harvested and kilned) and/or undried (wet) hops. These beers will exhibit especially aromas and flavors of green, almost chlorophyll-like or other fresh hop characters, in harmony with the characters of the base style of the beer. These beers may be aged and enjoyed after the initial fresh-hop character diminishes. Unique character from aged fresh hop beers may emerge, but they have yet to be defined.','eztext',404,'eng-GB',2,0,'',1),(0,321,102,NULL,NULL,NULL,'ezinteger',405,'eng-GB',2,0,'',1),(0,322,102,NULL,NULL,NULL,'ezinteger',406,'eng-GB',2,0,'',1),(0,323,102,NULL,NULL,NULL,'ezfloat',407,'eng-GB',2,0,'',1),(0,324,102,NULL,NULL,NULL,'ezfloat',408,'eng-GB',2,0,'',1),(0,319,103,NULL,NULL,'Pale American-Belgo-Style Ale','ezstring',409,'eng-GB',2,0,'pale american-belgo-style ale',1),(0,320,103,NULL,NULL,'These beers must portray the unique characters imparted by yeasts typically used in fruity and big Belgian-Style ales - These beers are not traditional Belgian styles which are already defined. They are unique beers unto themselves. Notes of banana, berry, apple, sometimes coriander spice-like and/or smoky-phenolic characters should be portrayed with balance of hops and malt character when fermented with such yeast. Hop aroma, flavor and bitterness not usually found in the base style, can be medium to very high and must show the characters of American hop varieties. Color falls in the blonde to amber range. Esters should be at medium to high levels. Diacetyl should not be evident. Chill haze may be evident. Sulfur-like yeast character should be absent.. No Brettanomyces character should be present. An ale which exhibits Brettanomyces character would be classified as \"American-style Brett Ale.\" A statement by the brewer that could include information such as style being elaborated upon, and other information about the entry with regard to flavor, aroma or appearance, is essential for fair assessment in competitions. Beers with Brettanomyces may be subcategorized under this category.','eztext',410,'eng-GB',2,0,'',1),(0,321,103,NULL,NULL,NULL,'ezinteger',411,'eng-GB',2,0,'',1),(0,322,103,NULL,NULL,NULL,'ezinteger',412,'eng-GB',2,0,'',1),(0,323,103,NULL,NULL,NULL,'ezfloat',413,'eng-GB',2,0,'',1),(0,324,103,NULL,NULL,NULL,'ezfloat',414,'eng-GB',2,0,'',1),(0,319,104,NULL,NULL,'Dark American-Belgo-Style Ale','ezstring',415,'eng-GB',2,0,'dark american-belgo-style ale',1),(0,320,104,NULL,NULL,'These beers must portray the unique characters imparted by yeasts typically used in fruity and big Belgian-Style ales - These beers are not traditional Belgian styles which are already defined. They are unique beers unto themselves. Notes of banana, berry, apple, sometimes coriander spice-like and/or smoky-phenolic characters should be portrayed with balance of hops and malt character when fermented with such yeast. Hop aroma, flavor and bitterness not usually found in the base style, can be medium to very high and must show the characters of American hop varieties. Dark color falls in the deep amber/brown to black range. Roasted malts or barley may have a range of character from subtle to robust, and should be reflected in the overall character and balance of the beer. Esters should be at medium to high levels. Diacetyl should not be evident. Chill haze may be evident. Sulfurlike yeast character should be absent. No Brettanomyces character should be present. An ale which exhibits Brettanomyces character would be classified as \"American-style Brett Ale.\"A statement by the brewer that could include information such as style being elaborated upon, and other information about the entry with regard to flavor, aroma or appearance, is essential for fair assessment in competitions. Beers with Brettanomyces may be subcategorized under this category','eztext',416,'eng-GB',2,0,'',1),(0,321,104,NULL,NULL,NULL,'ezinteger',417,'eng-GB',2,0,'',1),(0,322,104,NULL,NULL,NULL,'ezinteger',418,'eng-GB',2,0,'',1),(0,323,104,NULL,NULL,NULL,'ezfloat',419,'eng-GB',2,0,'',1),(0,324,104,NULL,NULL,NULL,'ezfloat',420,'eng-GB',2,0,'',1),(0,319,105,NULL,NULL,'American-Style Strong Pale Ale','ezstring',421,'eng-GB',2,0,'american-style strong pale ale',1),(0,320,105,NULL,NULL,'American strong pale ales range from deep golden to copper in color. The style is characterized by floral and citrus-like American-variety hops used to produce high hop bitterness, flavor, and aroma. Note that floral, fruity, citrus-like, piney, resinous, or sulfur-like American-variety hop character is the perceived end, but may be a result of the skillful use of hops of other national origins. American strong pale ales have medium body and low to medium maltiness. Low caramel character is allowable. Fruityester flavor and aroma should be moderate to strong. Diacetyl should be absent or present at very low levels. Chill haze is allowable at cold temperatures.','eztext',422,'eng-GB',2,0,'',1),(0,321,105,NULL,40,NULL,'ezinteger',423,'eng-GB',2,40,'',1),(0,322,105,NULL,50,NULL,'ezinteger',424,'eng-GB',2,50,'',1),(0,323,105,5,NULL,NULL,'ezfloat',425,'eng-GB',2,0,'',1),(0,324,105,6,NULL,NULL,'ezfloat',426,'eng-GB',2,0,'',1),(0,319,106,NULL,NULL,'American-Style India Pale Ale','ezstring',427,'eng-GB',2,0,'american-style india pale ale',1),(0,320,106,NULL,NULL,'American-style India pale ales are perceived to have medium-high to intense hop bitterness, flavor and aroma with medium-high alcohol content. The style is further characterized by floral, fruity, citrus-like, piney, resinous, or sulfur-like American-variety hop character. Note that one or more of these American-variety hop characters is the perceived end, but the hop characters may be a result of the skillful use of hops of other national origins. The use of water with high mineral content results in a crisp, dry beer. This pale gold to deep copper-colored ale has a full, flowery hop aroma and may have a strong hop flavor (in addition to the perception of hop bitterness). India pale ales possess medium maltiness which contributes to a medium body. Fruity-ester flavors and aromas are moderate to very strong. Diacetyl can be absent or may be perceived at very low levels. Chill and/or hop haze is allowable at cold temperatures. (English and citrus-like American hops are considered enough of a distinction justifying separate American-style IPA and English-style IPA categories or subcategories. Hops of other origins may be used for bitterness or approximating traditional American or English character. See English-style India Pale Ale','eztext',428,'eng-GB',2,0,'',1),(0,321,106,NULL,50,NULL,'ezinteger',429,'eng-GB',2,50,'',1),(0,322,106,NULL,70,NULL,'ezinteger',430,'eng-GB',2,70,'',1),(0,323,106,6,NULL,NULL,'ezfloat',431,'eng-GB',2,0,'',1),(0,324,106,7,NULL,NULL,'ezfloat',432,'eng-GB',2,0,'',1),(0,319,107,NULL,NULL,'Imperial or Double India Pale Ale','ezstring',433,'eng-GB',2,0,'imperial or double india pale ale',1),(0,320,107,NULL,NULL,'Imperial or Double India Pale Ales have intense hop bitterness, flavor and aroma. Alcohol content is medium-high to high and notably evident. They range from deep golden to medium copper in color. The style may use any variety of hops. Though the hop character is intense it\'s balanced with complex alcohol flavors, moderate to high fruity esters and medium to high malt character. Hop character should be fresh and lively and should not be harsh in quality. The use of large amounts of hops may cause a degree of appropriate hop haze. Imperial or Double India Pale Ales have medium-high to full body. Diacetyl should not be perceived. The intention of this style of beer is to exhibit the fresh and bright character of hops. Oxidative character and aged character should not be present.','eztext',434,'eng-GB',2,0,'',1),(0,321,107,NULL,65,NULL,'ezinteger',435,'eng-GB',2,65,'',1),(0,322,107,NULL,100,NULL,'ezinteger',436,'eng-GB',2,100,'',1),(0,323,107,7,NULL,NULL,'ezfloat',437,'eng-GB',2,0,'',1),(0,324,107,10,NULL,NULL,'ezfloat',438,'eng-GB',2,0,'',1),(0,319,108,NULL,NULL,'American-Style Amber/Red Ale','ezstring',439,'eng-GB',2,0,'american-style amber/red ale',1),(0,320,108,NULL,NULL,'American amber/red ales range from light copper to light brown in color. They are characterized by American-variety hops used to produce the perception of medium hop bitterness, flavor, and medium aroma. Amber ales have medium-high to high maltiness with medium to low caramel character. They should have medium to medium-high body. The style may have low levels of fruityester flavor and aroma. Diacetyl can be either absent or barely perceived at very low levels. Chill haze is allowable at cold temperatures. Slight yeast haze is acceptable for bottle-conditioned products.','eztext',440,'eng-GB',2,0,'',1),(0,321,108,NULL,30,NULL,'ezinteger',441,'eng-GB',2,30,'',1),(0,322,108,NULL,40,NULL,'ezinteger',442,'eng-GB',2,40,'',1),(0,323,108,4,NULL,NULL,'ezfloat',443,'eng-GB',2,0,'',1),(0,324,108,6,NULL,NULL,'ezfloat',444,'eng-GB',2,0,'',1),(0,319,109,NULL,NULL,'Imperial or Double Red Ale','ezstring',445,'eng-GB',2,0,'imperial or double red ale',1),(0,320,109,NULL,NULL,'Imperial or Double Red Ales have intense hop bitterness, flavor and aroma. Alcohol content is also very high and of notable character. They range from deep amber to dark copper in color and may exhibit a small amount of chill haze at cold temperatures The style may use any variety of hops. Though the hop character is intense it\'s balanced with complex alcohol flavors, moderate to high fruity esters and medium to high caramel malt character. Imperial or Double Red Ales have a full body. Diacetyl should not be perceived.','eztext',446,'eng-GB',2,0,'',1),(0,321,109,NULL,55,NULL,'ezinteger',447,'eng-GB',2,55,'',1),(0,322,109,NULL,85,NULL,'ezinteger',448,'eng-GB',2,85,'',1),(0,323,109,7,NULL,NULL,'ezfloat',449,'eng-GB',2,0,'',1),(0,324,109,10,NULL,NULL,'ezfloat',450,'eng-GB',2,0,'',1),(0,319,110,NULL,NULL,'American-Style Barley Wine Ale','ezstring',451,'eng-GB',2,0,'american-style barley wine ale',1),(0,320,110,NULL,NULL,'American style barley wines range from amber to deep copper-garnet in color and have a full body and high residual malty sweetness. Complexity of alcohols and fruity-ester characters are often high and counterbalanced by assertive bitterness and extraordinary alcohol content. Hop aroma and flavor are at medium to very high levels. American type hops are often used but not necessary for this style. Very low levels of diacetyl may be acceptable. A caramel and/or toffee aroma and flavor are often part of the character. Characters indicating oxidation, such as vinous (sometimes sherry-like) aromas and/or flavors, are not generally acceptable in American-style Barley Wine Ale, however if a low level of age-induced oxidation character harmonizes and enhances the overall experience this can be regarded favorably. Chill haze is allowable at cold temperatures.','eztext',452,'eng-GB',2,0,'',1),(0,321,110,NULL,60,NULL,'ezinteger',453,'eng-GB',2,60,'',1),(0,322,110,NULL,100,NULL,'ezinteger',454,'eng-GB',2,100,'',1),(0,323,110,8,NULL,NULL,'ezfloat',455,'eng-GB',2,0,'',1),(0,324,110,12,NULL,NULL,'ezfloat',456,'eng-GB',2,0,'',1),(0,319,111,NULL,NULL,'American-Style Wheat Wine Ale','ezstring',457,'eng-GB',2,0,'american-style wheat wine ale',1),(0,320,111,NULL,NULL,'American style wheat wines range from gold to deep amber and are brewed with 50% or more wheat malt. They have full body and high residual malty sweetness. Perception of bitterness is moderate to medium -high. Fruity-ester characters are often high and counterbalanced by complexity of alcohols and high alcohol content. Hop aroma and flavor are at low to medium levels. Very low levels of diacetyl may be acceptable. Bready, wheat, honey-like and/or caramel aroma and flavor are often part of the character. Phenolic yeast character, sulfur, and/or sweet corn-like dimethylsulfide (DMS) should not be present. Oxidized, stale and aged characters are not typical of this style. Chill haze is allowable.','eztext',458,'eng-GB',2,0,'',1),(0,321,111,NULL,45,NULL,'ezinteger',459,'eng-GB',2,45,'',1),(0,322,111,NULL,85,NULL,'ezinteger',460,'eng-GB',2,85,'',1),(0,323,111,8,NULL,NULL,'ezfloat',461,'eng-GB',2,0,'',1),(0,324,111,12,NULL,NULL,'ezfloat',462,'eng-GB',2,0,'',1),(0,319,112,NULL,NULL,'Golden or Blonde Ale','ezstring',463,'eng-GB',2,0,'golden or blonde ale',1),(0,320,112,NULL,NULL,'Golden or Blonde ales are straw to golden blonde in color. They have a crisp, dry palate, light to medium body, and light malt sweetness. Low to medium hop aroma may be present but does not dominate. Bitterness is low to medium. Fruity esters may be perceived but do not predominate. Diacetyl should not be perceived. Chill haze should be absent.','eztext',464,'eng-GB',2,0,'',1),(0,321,112,NULL,15,NULL,'ezinteger',465,'eng-GB',2,15,'',1),(0,322,112,NULL,25,NULL,'ezinteger',466,'eng-GB',2,25,'',1),(0,323,112,4,NULL,NULL,'ezfloat',467,'eng-GB',2,0,'',1),(0,324,112,5,NULL,NULL,'ezfloat',468,'eng-GB',2,0,'',1),(0,319,113,NULL,NULL,'American-Style Brown Ale','ezstring',469,'eng-GB',2,0,'american-style brown ale',1),(0,320,113,NULL,NULL,'American brown ales range from deep copper to brown in color. Roasted malt caramel-like and chocolate-like characters should be of medium intensity in both flavor and aroma. American brown ales have evident low to medium hop flavor and aroma, medium to high hop bitterness, and a medium body. Estery and fruity-ester characters should be subdued. Diacetyl should not be perceived. Chill haze is allowable at cold temperatures.','eztext',470,'eng-GB',2,0,'',1),(0,321,113,NULL,25,NULL,'ezinteger',471,'eng-GB',2,25,'',1),(0,322,113,NULL,45,NULL,'ezinteger',472,'eng-GB',2,45,'',1),(0,323,113,4,NULL,NULL,'ezfloat',473,'eng-GB',2,0,'',1),(0,324,113,6,NULL,NULL,'ezfloat',474,'eng-GB',2,0,'',1),(0,319,114,NULL,NULL,'Smoke Porter','ezstring',475,'eng-GB',2,0,'smoke porter',1),(0,320,114,NULL,NULL,'Smoke porters are chestnut brown to black in color. They can exhibit a mild to assertive smoke character in balance with other beer characters. Black malt character can be perceived in some porters, while others may be absent of strong roast character. Roast barley character should be absent. Medium to full malt sweetness, caramel and chocolate are acceptable along with medium to medium-high hop bitterness. These beers are usually medium to full bodied. Fruity esters are acceptable. Hop flavor and aroma may vary from being negligible to medium in character.','eztext',476,'eng-GB',2,0,'',1),(0,321,114,NULL,20,NULL,'ezinteger',477,'eng-GB',2,20,'',1),(0,322,114,NULL,40,NULL,'ezinteger',478,'eng-GB',2,40,'',1),(0,323,114,5,NULL,NULL,'ezfloat',479,'eng-GB',2,0,'',1),(0,324,114,8,NULL,NULL,'ezfloat',480,'eng-GB',2,0,'',1),(0,319,115,NULL,NULL,'American-Style Brett Ale','ezstring',481,'eng-GB',2,0,'american-style brett ale',1),(0,320,115,NULL,NULL,'American Brett ales can be very light to black or take on the color of added fruits or other ingredients. Wood- and barrel- aged sour ales are classified elsewhere. The evolution of natural acidity develops balanced complexity. Horsey, goaty, leathery, phenolic and light to moderate and/or fruity acidic character evolved from Brettanomyces organisms may be evident, yet in balance with other character. Acidity may also be contributed to by bacteria, but may or may not dominate.  Residual flavors that come from liquids previously aged in a barrel such as bourbon or sherry should not be present. Wood vessels may be used during the fermentation and aging process, but wood-derived flavors such as vanillin must not be present. In darker versions, roasted malt, caramel-like and chocolate-like characters should be subtle in both flavor and aroma. American Brett ales may have evident full range of hop aroma and hop bitterness with a full range of body. Estery and fruity-ester characters are evident, sometimes moderate and sometimes intense, yet balanced. Diacetyl and sweet corn-like dimethylsulfide (DMS) should not be perceived. Chill haze, bacteria and yeast-induced haze are allowable at low to medium levels at any temperature. Fruited American-Style Brett Ales will exhibit fruit flavors in harmonious balance with other characters.','eztext',482,'eng-GB',2,0,'',1),(0,321,115,NULL,NULL,NULL,'ezinteger',483,'eng-GB',2,0,'',1),(0,322,115,NULL,NULL,NULL,'ezinteger',484,'eng-GB',2,0,'',1),(0,323,115,NULL,NULL,NULL,'ezfloat',485,'eng-GB',2,0,'',1),(0,324,115,NULL,NULL,NULL,'ezfloat',486,'eng-GB',2,0,'',1),(0,319,116,NULL,NULL,'American-Style Sour Ale','ezstring',487,'eng-GB',2,0,'american-style sour ale',1),(0,320,116,NULL,NULL,'American sour ales can be very light to black or take on the color of added fruits or other ingredients. There is no Brettanomyces character in this style of beer. Wood- and barrel-aged sour ales are classified elsewhere. If acidity is present it is usually in the form of lactic, acetic and other organic acids naturally developed with acidified malt in the mash or in fermentation by the use of various microorganisms including certain bacteria and yeasts. Acidic character can be a complex balance of several types of acid and characteristics of age. The evolution of natural acidity develops balanced complexity. Residual flavors that come from liquids previously aged in a barrel such as bourbon or sherry should not be present. Wood vessels may be used during the fermentation and aging process, but wood-derived flavors such as vanillin must not be present. In darker versions, roasted malt, caramel-like and chocolate-like characters should be subtle in both flavor and aroma. American sour may have evident full range of hop aroma and hop bitterness with a full range of body. Estery and fruity-ester characters are evident, sometimes moderate and sometimes intense, yet balanced. Diacetyl and sweet corn-like dimethylsulfide (DMS) should not be perceived. Chill haze, bacteria and yeast-induced haze are allowable at low to medium levels at any temperature. Fruited American-Style Sour Ales will exhibit fruit flavors in harmonious balance with other characters.','eztext',488,'eng-GB',2,0,'',1),(0,321,116,NULL,NULL,NULL,'ezinteger',489,'eng-GB',2,0,'',1),(0,322,116,NULL,NULL,NULL,'ezinteger',490,'eng-GB',2,0,'',1),(0,323,116,NULL,NULL,NULL,'ezfloat',491,'eng-GB',2,0,'',1),(0,324,116,NULL,NULL,NULL,'ezfloat',492,'eng-GB',2,0,'',1),(0,319,117,NULL,NULL,'American-Style Black Ale','ezstring',493,'eng-GB',2,0,'american-style black ale',1),(0,320,117,NULL,NULL,'American-style Black Ales are very dark to black and perceived to have medium high to high hop bitterness, flavor and aroma with medium-high alcohol content, balanced with a medium body. Fruity, floral and herbal character from hops of all origins may contribute character. The style is further characterized by a balanced and moderate degree of caramel malt and dark roasted malt flavor and aroma. High astringency and high degree of burnt roast malt character should be absent.','eztext',494,'eng-GB',2,0,'',1),(0,321,117,NULL,50,NULL,'ezinteger',495,'eng-GB',2,50,'',1),(0,322,117,NULL,70,NULL,'ezinteger',496,'eng-GB',2,70,'',1),(0,323,117,6,NULL,NULL,'ezfloat',497,'eng-GB',2,0,'',1),(0,324,117,7,NULL,NULL,'ezfloat',498,'eng-GB',2,0,'',1),(0,319,118,NULL,NULL,'American-Style Stout','ezstring',499,'eng-GB',2,0,'american-style stout',1),(0,320,118,NULL,NULL,'Initial low to medium malt sweetness with a degree of caramel, chocolate and/or roasted coffee flavor with a distinctive dryroasted bitterness in the finish. Coffee-like roasted barley and roasted malt aromas are prominent. Some slight roasted malt acidity is permissible and a medium- to full-bodied mouthfeel is appropriate. Hop bitterness may be moderate to high. Hop aroma and flavor is moderate to high, often with American citrus-type and/or resiny hop character. The perception of fruity esters is low. Roasted malt/barley astringency may be low but not excessive. Diacetyl (butterscotch) should be negligible or not perceived. Head retention is excellent.','eztext',500,'eng-GB',2,0,'',1),(0,321,118,NULL,35,NULL,'ezinteger',501,'eng-GB',2,35,'',1),(0,322,118,NULL,60,NULL,'ezinteger',502,'eng-GB',2,60,'',1),(0,323,118,5,NULL,NULL,'ezfloat',503,'eng-GB',2,0,'',1),(0,324,118,8,NULL,NULL,'ezfloat',504,'eng-GB',2,0,'',1),(0,319,119,NULL,NULL,'American-Style Imperial Stout','ezstring',505,'eng-GB',2,0,'american-style imperial stout',1),(0,320,119,NULL,NULL,'Black in color, American-style imperial stouts typically have a high alcohol content. Generally characterized as very robust. The extremely rich malty flavor and aroma are balanced with assertive hopping and fruity-ester characteristics. Bitterness should be moderately high to very high and balanced with full sweet malt character. Roasted malt astringency and bitterness can be moderately perceived but should not overwhelm the overall character. Hop aroma is usually moderately-high to overwhelmingly hop-floral, -citrus or -herbal. Diacetyl (butterscotch) levels should be absent.','eztext',506,'eng-GB',2,0,'',1),(0,321,119,NULL,50,NULL,'ezinteger',507,'eng-GB',2,50,'',1),(0,322,119,NULL,80,NULL,'ezinteger',508,'eng-GB',2,80,'',1),(0,323,119,7,NULL,NULL,'ezfloat',509,'eng-GB',2,0,'',1),(0,324,119,12,NULL,NULL,'ezfloat',510,'eng-GB',2,0,'',1),(0,319,120,NULL,NULL,'Specialty Stouts','ezstring',511,'eng-GB',2,0,'specialty stouts',1),(0,320,120,NULL,NULL,'See British Origin American-Style Imperial Porter Imperial porters are very dark brown to black in color. No roast barley or strong burnt/astringent black malt character should be perceived. Medium malt, caramel and cocoa-like sweetness should be in harmony with medium-low to medium hop bitterness. This is a full bodied beer. Ale-like fruity esters should be evident but not overpowering and compliment malt derived sweetness and hop character. Hop flavor and aroma may vary from being low to medium-high. Diacetyl (butterscotch) levels should be absent.','eztext',512,'eng-GB',2,0,'',1),(0,321,120,NULL,35,NULL,'ezinteger',513,'eng-GB',2,35,'',1),(0,322,120,NULL,50,NULL,'ezinteger',514,'eng-GB',2,50,'',1),(0,323,120,7,NULL,NULL,'ezfloat',515,'eng-GB',2,0,'',1),(0,324,120,12,NULL,NULL,'ezfloat',516,'eng-GB',2,0,'',1),(0,318,121,NULL,NULL,'German Origin Ales','ezstring',517,'eng-GB',2,0,'german origin ales',1),(0,319,122,NULL,NULL,'German-Style Klsch / Kln-Style Klsch','ezstring',518,'eng-GB',2,0,'german-style klsch / kln-style klsch',1),(0,320,122,NULL,NULL,'Klsch is warm fermented and aged at cold temperatures (German ale or alt-style beer). Klsch is characterized by a golden to straw color and a slightly dry, subtly sweet softness on the palate, yet crisp. Good, dense head retention is desirable. Light pearapple-Riesling wine-like fruitiness may be apparent, but is not necessary for this style. Caramel character should not be evident. The body is light to medium-light. This beer has low hop flavor and aroma with medium bitterness. Wheat can be used in brewing this beer. Ale yeast is used for fermentation, though lager yeast is sometimes used in the bottle or final cold conditioning process. Fruity esters should be minimally perceived, if at all. Chill haze should be absent.','eztext',519,'eng-GB',2,0,'',1),(0,321,122,NULL,18,NULL,'ezinteger',520,'eng-GB',2,18,'',1),(0,322,122,NULL,25,NULL,'ezinteger',521,'eng-GB',2,25,'',1),(0,323,122,4,NULL,NULL,'ezfloat',522,'eng-GB',2,0,'',1),(0,324,122,5,NULL,NULL,'ezfloat',523,'eng-GB',2,0,'',1),(0,319,123,NULL,NULL,'Berliner-Style Weisse (Wheat)','ezstring',524,'eng-GB',2,0,'berliner-style weisse (wheat)',1),(0,320,123,NULL,NULL,'This is very pale in color and the lightest of all the German wheat beers. The unique combination of yeast and lactic acid bacteria fermentation yields a beer that is acidic, highly attenuated, and very light bodied. The carbonation of a Berliner Weisse is high, and hop rates are very low. Clarity may be hazy or cloudy from yeast or chill haze. Hop character should not be perceived. Fruity esters will be evident. No diacetyl should be perceived.','eztext',525,'eng-GB',2,0,'',1),(0,321,123,NULL,3,NULL,'ezinteger',526,'eng-GB',2,3,'',1),(0,322,123,NULL,6,NULL,'ezinteger',527,'eng-GB',2,6,'',1),(0,323,123,2,NULL,NULL,'ezfloat',528,'eng-GB',2,0,'',1),(0,324,123,3,NULL,NULL,'ezfloat',529,'eng-GB',2,0,'',1),(0,319,124,NULL,NULL,'Leipzig-Style Gose','ezstring',530,'eng-GB',2,0,'leipzig-style gose',1),(0,320,124,NULL,NULL,'Traditional examples of Gose are spontaneously fermented, similarly to Belgian-style gueuze/lambic beers, and should exhibit complexity of acidic, flavor and aroma contributed by introduction of wild yeast and bacteria into the fermentation. A primary difference between Belgian Gueuze and German Gose is that Gose is served at a much younger age. Gose is typically pale gold to pale amber in color and typically contains malted barley, unmalted wheat with some traditional varieties containing oats. Hop character and malt flavors and aromas are negligible. Lemony or other citrus-like qualities are often present in aroma and on the palate. Some versions may have the spicy character of added coriander in aroma and on the palate at low to medium levels. Salt (table salt) character is also traditional in low amounts. Horsey, leathery, earthy aroma and flavors contributed by Brettanomyces yeasts may be evident but have a very low profile, as this beer is not excessively aged. Modern German Gose breweries typically introduce only pure beer yeast strains for fermentation. Low to medium lactic acid character is evident in all examples as sharp, refreshing sourness. Gose is typically enjoyed fresh, carbonated, and cloudy/hazy with yeast character, and may have evidence of continued fermentation activity. Overall complexity of flavors and aromas are sought while maintaining an ideal balance between acidity, yeast-enhanced spice and refreshment is ideal.','eztext',531,'eng-GB',2,0,'',1),(0,321,124,NULL,10,NULL,'ezinteger',532,'eng-GB',2,10,'',1),(0,322,124,NULL,15,NULL,'ezinteger',533,'eng-GB',2,15,'',1),(0,323,124,4,NULL,NULL,'ezfloat',534,'eng-GB',2,0,'',1),(0,324,124,5,NULL,NULL,'ezfloat',535,'eng-GB',2,0,'',1),(0,319,125,NULL,NULL,'South German-Style Hefeweizen / Hefeweissbier','ezstring',536,'eng-GB',2,0,'south german-style hefeweizen / hefeweissbier',1),(0,320,125,NULL,NULL,'The aroma and flavor of a Weissbier with yeast is decidedly fruity and phenolic. The phenolic characteristics are often described as clove-, nutmeg-like, mildly smoke-like or even vanilla-like. Banana-like esters should be present at low to medium-high levels. These beers are made with at least 50 percent malted wheat, and hop rates are quite low. Hop flavor and aroma are absent or present at very low levels. Weissbier is well attenuated and very highly carbonated and a medium to full bodied beer. The color is very pale to pale amber. Because yeast is present, the beer will have yeast flavor and a characteristically fuller mouthfeel and may be appropriately very cloudy. No diacetyl should be perceived.','eztext',537,'eng-GB',2,0,'',1),(0,321,125,NULL,10,NULL,'ezinteger',538,'eng-GB',2,10,'',1),(0,322,125,NULL,15,NULL,'ezinteger',539,'eng-GB',2,15,'',1),(0,323,125,4,NULL,NULL,'ezfloat',540,'eng-GB',2,0,'',1),(0,324,125,5,NULL,NULL,'ezfloat',541,'eng-GB',2,0,'',1),(0,319,126,NULL,NULL,'South German-Style Kristall Weizen / Kristall Weissbier','ezstring',542,'eng-GB',2,0,'south german-style kristall weizen / kristall weissbier',1),(0,320,126,NULL,NULL,'The aroma and flavor of a Weissbier without yeast is very similar to Weissbier with yeast (Hefeweizen/Hefeweissbier) with the caveat that fruity and phenolic characters are not combined with the yeasty flavor and fuller-bodied mouthfeel of yeast. The phenolic characteristics are often described as clove- or nutmeg-like and can be smoky or even vanilla-like. Banana-like esters are often present. These beers are made with at least 50 percent malted wheat, and hop rates are quite low. Hop flavor and aroma are absent. Weissbier is well attenuated and very highly carbonated, yet its relatively high starting gravity and alcohol content make it a medium- to full-bodied beer. The color is very pale to deep golden. Because the beer has been filtered, yeast is not present. The beer will have no flavor of yeast and a cleaner, drier mouthfeel. The beer should be clear with no chill haze present. No diacetyl should be perceived.','eztext',543,'eng-GB',2,0,'',1),(0,321,126,NULL,10,NULL,'ezinteger',544,'eng-GB',2,10,'',1),(0,322,126,NULL,15,NULL,'ezinteger',545,'eng-GB',2,15,'',1),(0,323,126,4,NULL,NULL,'ezfloat',546,'eng-GB',2,0,'',1),(0,324,126,5,NULL,NULL,'ezfloat',547,'eng-GB',2,0,'',1),(0,319,127,NULL,NULL,'German-Style Leichtes Weizen / Weissbier','ezstring',548,'eng-GB',2,0,'german-style leichtes weizen / weissbier',1),(0,320,127,NULL,NULL,'The German word leicht means light, and as such these beers are light versions of Hefeweizen. Leicht Weissbier is top fermented and cloudy like Hefeweizen. The phenolic and estery aromas and flavors typical of Weissbiers are more subdued in Leichtes Weizen. Hop flavor and aroma are normally absent. The overall flavor profile is less complex than Hefeweizen due to decreased alcohol content. There is less yeasty flavor present. Leichtes Weissbier has diminished mouth feel relative to Hefeweizen, and is a low-bodied beer. No diacetyl should be perceived. The beer may have a broad range of color from pale golden to pale amber.','eztext',549,'eng-GB',2,0,'',1),(0,321,127,NULL,10,NULL,'ezinteger',550,'eng-GB',2,10,'',1),(0,322,127,NULL,20,NULL,'ezinteger',551,'eng-GB',2,20,'',1),(0,323,127,2,NULL,NULL,'ezfloat',552,'eng-GB',2,0,'',1),(0,324,127,3,NULL,NULL,'ezfloat',553,'eng-GB',2,0,'',1),(0,319,128,NULL,NULL,'South German-Style Bernsteinfarbenes Weizen / Weissbier','ezstring',554,'eng-GB',2,0,'south german-style bernsteinfarbenes weizen / weissbier',1),(0,320,128,NULL,NULL,'The German word Bernsteinfarben means amber colored, and as such, a Bernsteinfarbenes Weizen is dark yellow to amber in color. This beer style is characterized by a distinct sweet maltiness and caramel or bready character from the use of medium colored malts. Estery and phenolic elements of this Weissbier should be evident but subdued. Bernsteinfarbenes Weissbier is well attenuated and very highly carbonated, and hop bitterness is low. Hop flavor and aroma are absent. The percentage of wheat malt is at least 50 percent. If this is served with yeast, the beer may be appropriately very cloudy. No diacetyl should be perceived.','eztext',555,'eng-GB',2,0,'',1),(0,321,128,NULL,10,NULL,'ezinteger',556,'eng-GB',2,10,'',1),(0,322,128,NULL,15,NULL,'ezinteger',557,'eng-GB',2,15,'',1),(0,323,128,4,NULL,NULL,'ezfloat',558,'eng-GB',2,0,'',1),(0,324,128,5,NULL,NULL,'ezfloat',559,'eng-GB',2,0,'',1),(0,319,129,NULL,NULL,'South German-Style Dunkel Weizen / Dunkel Weissbier','ezstring',560,'eng-GB',2,0,'south german-style dunkel weizen / dunkel weissbier',1),(0,320,129,NULL,NULL,'This beer style is characterized by a distinct sweet maltiness and a chocolate-like character from roasted malt. Estery and phenolic elements of this Weissbier should be evident but subdued. Color can range from copper-brown to dark brown. Dunkel Weissbier is well attenuated and very highly carbonated, and hop bitterness is low. Hop flavor and aroma are absent. Usually dark barley malts are used in conjunction with dark cara or color malts, and the percentage of wheat malt is at least 50 percent. If this is served with yeast, the beer may be appropriately very cloudy. No diacetyl should be perceived.','eztext',561,'eng-GB',2,0,'',1),(0,321,129,NULL,10,NULL,'ezinteger',562,'eng-GB',2,10,'',1),(0,322,129,NULL,15,NULL,'ezinteger',563,'eng-GB',2,15,'',1),(0,323,129,4,NULL,NULL,'ezfloat',564,'eng-GB',2,0,'',1),(0,324,129,5,NULL,NULL,'ezfloat',565,'eng-GB',2,0,'',1),(0,319,130,NULL,NULL,'South German-Style Weizenbock / Weissbock','ezstring',566,'eng-GB',2,0,'south german-style weizenbock / weissbock',1),(0,320,130,NULL,NULL,'This style can be either pale or dark (golden to dark brown in color) and has a high starting gravity and alcohol content. The malty sweetness of a Weizenbock is balanced with a clove-like phenolic and fruity-estery banana element to produce a wellrounded aroma and flavor. As is true with all German wheat beers, hop bitterness is low and carbonation is high. Hop flavor and aroma are absent. It has a medium to full body. If dark, a mild roast malt character should emerge in flavor and to a lesser degree in the aroma. If this is served with yeast the beer may be appropriately very cloudy. No diacetyl should be perceived.','eztext',567,'eng-GB',2,0,'',1),(0,321,130,NULL,15,NULL,'ezinteger',568,'eng-GB',2,15,'',1),(0,322,130,NULL,35,NULL,'ezinteger',569,'eng-GB',2,35,'',1),(0,323,130,6,NULL,NULL,'ezfloat',570,'eng-GB',2,0,'',1),(0,324,130,9,NULL,NULL,'ezfloat',571,'eng-GB',2,0,'',1),(0,319,131,NULL,NULL,'Bamberg-Style Weiss (Smoke) Rauchbier (Dunkel or Helles)','ezstring',572,'eng-GB',2,0,'bamberg-style weiss (smoke) rauchbier (dunkel or helles)',1),(0,320,131,NULL,NULL,'Bamberg-style Weiss Rauchbier should have smoky characters that range from detectable to prevalent in the aroma and flavor. Smoke character is not harshly phenolic, but rather very smooth, almost rendering a perception of mild sweetness to this style of beer. The aroma and flavor of a Weissbier with yeast is decidedly fruity and phenolic. The phenolic characteristics are often described as clove- or nutmeg-like and can be smoky or even vanilla-like. Banana-like esters are often present. These beers are made with at least 50 percent malted wheat, and hop rates are quite low. Hop flavor and aroma are absent. Weissbier is well attenuated and very highly carbonated and a medium- to full-bodied beer. The color is very pale to very dark amber. Darker (dunkel) styles should have a detectable degree of roast malt in the balance without being robust in overall character. Because yeast is present, the beer will have yeast flavor and a characteristically fuller mouthfeel and may be appropriately very cloudy. No diacetyl should be perceived.','eztext',573,'eng-GB',2,0,'',1),(0,321,131,NULL,10,NULL,'ezinteger',574,'eng-GB',2,10,'',1),(0,322,131,NULL,15,NULL,'ezinteger',575,'eng-GB',2,15,'',1),(0,323,131,4,NULL,NULL,'ezfloat',576,'eng-GB',2,0,'',1),(0,324,131,5,NULL,NULL,'ezfloat',577,'eng-GB',2,0,'',1),(0,319,132,NULL,NULL,'German-Style Brown Ale / Dsseldorf-Style Altbier','ezstring',578,'eng-GB',2,0,'german-style brown ale / dsseldorf-style altbier',1),(0,320,132,NULL,NULL,'Copper to brown in color, this German ale may be highly hopped and intensely bitter (although the 25 to 35 IBU range is more normal for the majority of Altbiers from Dsseldorf) and has a medium body and malty flavor. A variety of malts, including wheat, may be used. Hop character may be low to medium in the flavor and aroma. The overall impression is clean, crisp, and flavorful often with a dry finish. Fruity esters can be low. No diacetyl or chill haze should be perceived.','eztext',579,'eng-GB',2,0,'',1),(0,321,132,NULL,25,NULL,'ezinteger',580,'eng-GB',2,25,'',1),(0,322,132,NULL,52,NULL,'ezinteger',581,'eng-GB',2,52,'',1),(0,323,132,4,NULL,NULL,'ezfloat',582,'eng-GB',2,0,'',1),(0,324,132,5,NULL,NULL,'ezfloat',583,'eng-GB',2,0,'',1),(0,319,133,NULL,NULL,'Kellerbier (Cellar beer) or Zwickelbier - Ale','ezstring',584,'eng-GB',2,0,'kellerbier (cellar beer) or zwickelbier - ale',1),(0,320,133,NULL,NULL,'These beers are unfiltered German-style Altbier and Klsch. They are packaged and/or served intentionally with low to moderate amounts of yeast. Products may be filtered and again dosed with yeast in the package, manifesting themselves as bottle conditioned beers or unfiltered beer with yeast present. They will most likely not be clear, and may appear slightly hazy to moderately cloudy. Yeast character, flavor and aroma are desirable, yet should be low to medium but not overpowering the balance and character of malt and hops. Low to moderately low levels of yeast-generated sulfur containing compounds should be apparent in aroma and flavor, and low levels of acetaldehyde or other volatiles normally removed during fermentation may or may not be apparent. The sulfur and acetaldehyde characters should contribute positively to the beer drinking experience. Head retention may not be optimal. The brewer must indicate the classic style on which the entry is based to allow for accurate judging. Beer entries not accompanied by this information will be at a disadvantage during evaluation.','eztext',585,'eng-GB',2,0,'',1),(0,321,133,NULL,NULL,NULL,'ezinteger',586,'eng-GB',2,0,'',1),(0,322,133,NULL,NULL,NULL,'ezinteger',587,'eng-GB',2,0,'',1),(0,323,133,NULL,NULL,NULL,'ezfloat',588,'eng-GB',2,0,'',1),(0,324,133,NULL,NULL,NULL,'ezfloat',589,'eng-GB',2,0,'',1),(0,318,134,NULL,NULL,'Belgian And French Origin Ales','ezstring',590,'eng-GB',2,0,'belgian and french origin ales',1),(0,319,135,NULL,NULL,'Belgian-Style Flanders Oud Bruin or Oud Red Ales','ezstring',591,'eng-GB',2,0,'belgian-style flanders oud bruin or oud red ales',1),(0,320,135,NULL,NULL,'This light- to medium-bodied deep copper to brown ale is characterized by a slight to strong lactic sourness, and with \"Reds\" sometimes a balanced degree of acetic acid. Brettanomyces produced flavors and aromas are not part of character. A fruity-estery character which is often cherry-like is apparent with no hop flavor or aroma. Flanders brown ales have low to medium bitterness and a cocoa-like character from roast malt. Roasted malt character in aroma and flavor is acceptable at low levels. A very low degree of malt sweetness may be present and in balance with the acidity produced by Lactobacillus activity. Oak-like or woody characters may be pleasantly integrated into overall palate. Chill haze is acceptable at low serving temperatures. Some versions may be more highly carbonated and, when bottle conditioned, may appear cloudy (yeast) when served. These final beers are often blended old with new before packaging in order to create the brewer\'s intended balance of characters.','eztext',592,'eng-GB',2,0,'',1),(0,321,135,NULL,15,NULL,'ezinteger',593,'eng-GB',2,15,'',1),(0,322,135,NULL,25,NULL,'ezinteger',594,'eng-GB',2,25,'',1),(0,323,135,4,NULL,NULL,'ezfloat',595,'eng-GB',2,0,'',1),(0,324,135,6,NULL,NULL,'ezfloat',596,'eng-GB',2,0,'',1),(0,319,136,NULL,NULL,'Belgian-Style Dubbel','ezstring',597,'eng-GB',2,0,'belgian-style dubbel',1),(0,320,136,NULL,NULL,'This medium-bodied, red to dark brown colored ale has a malty sweetness and chocolate-like caramel aroma. A light hop flavor and/or aroma is acceptable. Dubbels are also characterized by low-medium to medium bitterness. No diacetyl is acceptable. Yeastgenerated fruity esters (especially banana) are appropriate at low levels. Head retention is dense and mousse-like. Chill haze is acceptable at low serving temperatures. Often bottle conditioned a slight yeast haze and flavor may be evident.','eztext',598,'eng-GB',2,0,'',1),(0,321,136,NULL,20,NULL,'ezinteger',599,'eng-GB',2,20,'',1),(0,322,136,NULL,30,NULL,'ezinteger',600,'eng-GB',2,30,'',1),(0,323,136,6,NULL,NULL,'ezfloat',601,'eng-GB',2,0,'',1),(0,324,136,7,NULL,NULL,'ezfloat',602,'eng-GB',2,0,'',1),(0,319,137,NULL,NULL,'Belgian-Style Tripel','ezstring',603,'eng-GB',2,0,'belgian-style tripel',1),(0,320,137,NULL,NULL,'Tripels are often characterized by a complex, sometimes mild spicy character. Clove-like phenolic flavor and aroma may be evident at extremely low levels. Yeast-generated  fruity esters, including banana, are also common, but not necessary. These pale/light-colored ales may finish sweet, though any sweet finish should be light. The beer is characteristically medium and clean in body with an equalizing hop/malt balance and a perception of medium to medium high hop bitterness. Traditional Belgian Tripels are often well attenuated. Brewing sugar may be used to lighten the perception of body. Its sweetness will come from very pale malts. There should not be character from any roasted or dark malts. Low hop flavor is acceptable. Alcohol strength and flavor should be perceived as evident. Head retention is dense and mousse-like. Chill haze is acceptable at low serving temperatures. Traditional Tripels are bottle conditioned, may exhibit slight yeast haze but the yeast should not be intentionally roused. Oxidative character if evident in aged Tripels should be mild and pleasant.','eztext',604,'eng-GB',2,0,'',1),(0,321,137,NULL,20,NULL,'ezinteger',605,'eng-GB',2,20,'',1),(0,322,137,NULL,45,NULL,'ezinteger',606,'eng-GB',2,45,'',1),(0,323,137,7,NULL,NULL,'ezfloat',607,'eng-GB',2,0,'',1),(0,324,137,10,NULL,NULL,'ezfloat',608,'eng-GB',2,0,'',1),(0,319,138,NULL,NULL,'Belgian-Style Quadrupel','ezstring',609,'eng-GB',2,0,'belgian-style quadrupel',1),(0,320,138,NULL,NULL,'Quadrupels or \"Quads\" are characterized by the immense presence of alcohol and balanced flavor, bitterness and aromas. Its color is deep amber to rich chestnut/garnet brown. Often characterized by a mousse-like dense, sometimes amber head will top off a properly poured and served quad. Complex fruity aroma and flavor emerge reminiscent of raisins, dates, figs, grapes, plums often accompanied with a hint of winy character. Caramel, dark sugar and malty sweet flavors and aromas can be intense, not cloying, while complementing fruitiness. Though well attenuated it usually has a full, creamy body. Hop characters do not dominate; low to low-medium bitterness is perceived. Perception of alcohol can be extreme. Clove-like phenolic flavor and aroma should not be evident. Chill haze is acceptable at low serving temperatures. Diacetyl and DMS should not be perceived. Well balanced with savoring/sipping drinkability. Oxidative character if evident in aged Quads should be mild and pleasant.','eztext',610,'eng-GB',2,0,'',1),(0,321,138,NULL,25,NULL,'ezinteger',611,'eng-GB',2,25,'',1),(0,322,138,NULL,50,NULL,'ezinteger',612,'eng-GB',2,50,'',1),(0,323,138,9,NULL,NULL,'ezfloat',613,'eng-GB',2,0,'',1),(0,324,138,14,NULL,NULL,'ezfloat',614,'eng-GB',2,0,'',1),(0,319,139,NULL,NULL,'Belgian-Style Blonde Ale','ezstring',615,'eng-GB',2,0,'belgian-style blonde ale',1),(0,320,139,NULL,NULL,'Belgian-style blond ales are characterized by low yet evident hop bitterness, flavor, and sometimes aroma. Light to medium body and low malt aroma with a sweet, spiced and a low to medium fruity-ester character orchestrated in flavor and aroma. Sugar may be used to lighten perceived body. They are blonde to golden in color. Noble-type hops are commonly used. Low levels of phenolic spiciness from yeast byproducts may be perceived. Diacetyl should not be perceived. Acidic character should not be present. Chill haze is allowable at cold temperatures.','eztext',616,'eng-GB',2,0,'',1),(0,321,139,NULL,15,NULL,'ezinteger',617,'eng-GB',2,15,'',1),(0,322,139,NULL,30,NULL,'ezinteger',618,'eng-GB',2,30,'',1),(0,323,139,6,NULL,NULL,'ezfloat',619,'eng-GB',2,0,'',1),(0,324,139,7,NULL,NULL,'ezfloat',620,'eng-GB',2,0,'',1),(0,319,140,NULL,NULL,'Belgian-Style Pale Ale','ezstring',621,'eng-GB',2,0,'belgian-style pale ale',1),(0,320,140,NULL,NULL,'Belgian-style pale ales are characterized by low but noticeable hop bitterness, flavor, and aroma. Light to medium body and low malt aroma are typical. They are light amber to deep amber in color. Noble-type hops are commonly used. Low to medium fruity esters are evident in aroma and flavor. Low levels of phenolic spiciness from yeast byproducts may be perceived. Low caramel or toasted malt flavor is okay. Diacetyl should not be perceived. Chill haze is allowable at cold temperatures.','eztext',622,'eng-GB',2,0,'',1),(0,321,140,NULL,20,NULL,'ezinteger',623,'eng-GB',2,20,'',1),(0,322,140,NULL,30,NULL,'ezinteger',624,'eng-GB',2,30,'',1),(0,323,140,4,NULL,NULL,'ezfloat',625,'eng-GB',2,0,'',1),(0,324,140,6,NULL,NULL,'ezfloat',626,'eng-GB',2,0,'',1),(0,319,141,NULL,NULL,'Belgian-Style Pale Strong Ale','ezstring',627,'eng-GB',2,0,'belgian-style pale strong ale',1),(0,320,141,NULL,NULL,'Belgian pale strong ales are pale to golden in color with relatively light body for a beer of its alcoholic strength. Often brewed with light colored Belgian \"candy\" sugar, these beers are well attenuated. The perception of hop bitterness is medium-low to medium -high, with hop flavor and aroma also in this range. These beers are highly attenuated and have a perceptively deceiving high alcoholic character-being light to medium bodied rather than full bodied. The intensity of malt character should be low to medium, often surviving along with a complex fruitiness. Very little or no diacetyl is perceived. Herbs and spices are sometimes used to delicately flavor these strong ales. Low levels of phenolic spiciness from yeast byproducts may also be perceived. Chill haze is allowable at cold temperatures.','eztext',628,'eng-GB',2,0,'',1),(0,321,141,NULL,20,NULL,'ezinteger',629,'eng-GB',2,20,'',1),(0,322,141,NULL,50,NULL,'ezinteger',630,'eng-GB',2,50,'',1),(0,323,141,7,NULL,NULL,'ezfloat',631,'eng-GB',2,0,'',1),(0,324,141,11,NULL,NULL,'ezfloat',632,'eng-GB',2,0,'',1),(0,319,142,NULL,NULL,'Belgian-Style Dark Strong Ale','ezstring',633,'eng-GB',2,0,'belgian-style dark strong ale',1),(0,320,142,NULL,NULL,'Belgian dark strong ales are amber to dark brown in color. Often, though not always, brewed with dark Belgian \"candy\" sugar, these beers can be well attenuated, ranging from medium to full-bodied. The perception of hop bitterness is low to medium, with hop flavor and aroma also in this range. Fruity complexity along with the soft flavors of roasted malts add distinct character. The alcohol strength of these beers can often be deceiving to the senses. The intensity of malt character can be rich, creamy, and sweet with intensities ranging from medium to high. Very little or no diacetyl is perceived. Herbs and spices are sometimes used to delicately flavor these strong ales. Low levels of phenolic spiciness from yeast byproducts may also be perceived. Chill haze is allowable at cold temperatures.','eztext',634,'eng-GB',2,0,'',1),(0,321,142,NULL,20,NULL,'ezinteger',635,'eng-GB',2,20,'',1),(0,322,142,NULL,50,NULL,'ezinteger',636,'eng-GB',2,50,'',1),(0,323,142,7,NULL,NULL,'ezfloat',637,'eng-GB',2,0,'',1),(0,324,142,11,NULL,NULL,'ezfloat',638,'eng-GB',2,0,'',1),(0,319,143,NULL,NULL,'Belgian-Style White (or Wit) / Belgian-Style Wheat','ezstring',639,'eng-GB',2,0,'belgian-style white (or wit) / belgian-style wheat',1),(0,320,143,NULL,NULL,'Belgian white ales are very pale in color and are brewed using unmalted wheat and malted barley and are spiced with coriander and orange peel. Coriander and light orange peel aroma should be perceived as such or as an unidentified spiciness. Phenolic spiciness and yeast flavors may be evident at mild levels. These beers are traditionally bottle conditioned and served cloudy. An unfiltered starch and yeast haze should be part of the appearance. The low to medium body should have some degree of creaminess from wheat starch. The style is further characterized by the use of noble-type hops to achieve low hop bitterness and little to no apparent hop flavor. This beer has no diacetyl and a low to medium fruity-ester level. Mild acidity is appropriate.','eztext',640,'eng-GB',2,0,'',1),(0,321,143,NULL,10,NULL,'ezinteger',641,'eng-GB',2,10,'',1),(0,322,143,NULL,17,NULL,'ezinteger',642,'eng-GB',2,17,'',1),(0,323,143,4,NULL,NULL,'ezfloat',643,'eng-GB',2,0,'',1),(0,324,143,5,NULL,NULL,'ezfloat',644,'eng-GB',2,0,'',1),(0,319,144,NULL,NULL,'Belgian-Style Lambic','ezstring',645,'eng-GB',2,0,'belgian-style lambic',1),(0,320,144,NULL,NULL,'Unblended, naturally and spontaneously fermented lambic is intensely estery, sour, and sometimes, but not necessarily, acetic flavored. Low in carbon dioxide, these hazy beers are brewed with unmalted wheat and malted barley. Sweet malt characters are not perceived. They are very low in hop bitterness. Cloudiness is acceptable. These beers are quite dry and light bodied. Characteristic horsey, goaty, leathery and phenolic character evolved from Brettanomyces yeast is often present at moderate levels. Versions of this beer made outside of the Brussels area of Belgium cannot be true lambics. These versions are said to be \"lambicstyle\" and may be made to resemble many of the beers of true origin. Vanillin and other wood-derived flavors should not be evident. Historically, traditional lambic is dry and completely attenuated, exhibiting no residual sweetness either from malt, sugar or artificial sweeteners. Sweet versions may be created through addition of sugars or artificial sweeteners. Competition organizers may choose to subcategorize this style into A) Traditional and B) Sweet. Artificial sweeteners are sometimes used in some brands.','eztext',646,'eng-GB',2,0,'',1),(0,321,144,NULL,11,NULL,'ezinteger',647,'eng-GB',2,11,'',1),(0,322,144,NULL,23,NULL,'ezinteger',648,'eng-GB',2,23,'',1),(0,323,144,6,NULL,NULL,'ezfloat',649,'eng-GB',2,0,'',1),(0,324,144,8,NULL,NULL,'ezfloat',650,'eng-GB',2,0,'',1),(0,319,145,NULL,NULL,'Belgian-Style Gueuze Lambic','ezstring',651,'eng-GB',2,0,'belgian-style gueuze lambic',1),(0,320,145,NULL,NULL,'Old lambic is blended with newly fermenting young lambic to create this special style of lambic. Gueuze is always referrmented in the bottle. These unflavored blended and secondary fermented lambic beers may be very dry or mildly sweet and are characterized by intense fruity-estery, sour, and acidic aromas and flavors. These pale beers are brewed with unmalted wheat, malted barley, and stale, aged hops. Sweet malt characters are not perceived. They are very low in hop bitterness. Diacetyl should be absent. Characteristic horsey, goaty, leathery and phenolic character evolved from Brettanomyces yeast is often present at moderate levels. Cloudiness is acceptable. These beers are quite dry and light bodied. Vanillin and other wood-derived flavors should not be evident. Versions of this beer made outside of the Brussels area of Belgium cannot be true lambics. These versions are said to be \"lambic-style\" and may be made to resemble many of the beers of true origin. Historically, traditional gueuze lambics are dry and completely attenuated, exhibiting no residual sweetness either from malt, sugar or artificial sweeteners. Some versions often have a degree of sweetness, contributed by sugars or artificial sweeteners. Competition organizers may choose to subcategorize this style into A) Traditional and B) Sweet.  Artificial sweeteners are sometimes used in some brands.','eztext',652,'eng-GB',2,0,'',1),(0,321,145,NULL,11,NULL,'ezinteger',653,'eng-GB',2,11,'',1),(0,322,145,NULL,23,NULL,'ezinteger',654,'eng-GB',2,23,'',1),(0,323,145,6,NULL,NULL,'ezfloat',655,'eng-GB',2,0,'',1),(0,324,145,8,NULL,NULL,'ezfloat',656,'eng-GB',2,0,'',1),(0,319,146,NULL,NULL,'Belgian-Style Fruit Lambic','ezstring',657,'eng-GB',2,0,'belgian-style fruit lambic',1),(0,320,146,NULL,NULL,'These beers, also known by the names framboise, kriek, peche, cassis, etc., are characterized by fruit flavors and aromas. The color reflects the choice of fruit. Sourness is an important part of the flavor profile, though sweetness may compromise the intensity. These flavored lambic beers may be very dry or mildly sweet and range from a dry to a full-bodied mouthfeel. Characteristic horsey, goaty, leathery and phenolic character evolved from Brettanomyces yeast is often present at moderate levels. Vanillin and other woody flavors should not be evident. Versions of this beer made outside of the Brussels area of Belgium cannot be true lambics. These versions are said to be \"lambic-style\" and may be made to resemble many of the beers of true origin. Historically, traditional lambics are dry and completely attenuated, exhibiting no residual sweetness either from malt, sugar, fruit or artificial sweeteners. Some versions often have a degree of sweetness, contributed by fruit sugars, other sugars or artificial sweeteners. Competition organizers may choose to subcategorize this style into A) Traditional and B) Sweet.  Artificial sweeteners are sometimes used in some brands.','eztext',658,'eng-GB',2,0,'',1),(0,321,146,NULL,15,NULL,'ezinteger',659,'eng-GB',2,15,'',1),(0,322,146,NULL,21,NULL,'ezinteger',660,'eng-GB',2,21,'',1),(0,323,146,5,NULL,NULL,'ezfloat',661,'eng-GB',2,0,'',1),(0,324,146,8,NULL,NULL,'ezfloat',662,'eng-GB',2,0,'',1),(0,319,147,NULL,NULL,'Belgian-Style Table Beer','ezstring',663,'eng-GB',2,0,'belgian-style table beer',1),(0,320,147,NULL,NULL,'These ales and lagers are very low in alcohol and historically in Belgium enjoyed with meals by both adults and children. Pale to very dark brown in color. Additions of caramel coloring are sometimes employed to adjust color. They are light bodied with relatively low carbonation with limited aftertaste. The mouth feel is light to moderate, though higher than one might anticipate, usually because of unfermented sugars/malt sugars. Malted barley, wheat and rye may be used as well as unmalted wheat, rye, oats and corn. A mild malt character could be evident. Aroma/Flavor hops are most commonly used to employ a flavor balance that is only low in bitterness. Traditional versions do not use artificial sweeteners nor are they excessively sweet. More modern versions of this beer incorporate sweeteners such as sugar and saccharine added post fermentation to sweeten the palate and add to a perception of smoothness. Spices (such as orange and lemon peel, as well as coriander) may be added in barely perceptible amounts, but this is not common. Diacetyl should not be perceived. Competition directors may choose to break out subcategories of Traditional and Modern.','eztext',664,'eng-GB',2,0,'',1),(0,321,147,NULL,5,NULL,'ezinteger',665,'eng-GB',2,5,'',1),(0,322,147,NULL,15,NULL,'ezinteger',666,'eng-GB',2,15,'',1),(0,323,147,0,NULL,NULL,'ezfloat',667,'eng-GB',2,0,'',1),(0,324,147,3,NULL,NULL,'ezfloat',668,'eng-GB',2,0,'',1),(0,319,148,NULL,NULL,'Other Belgian-Style Ales','ezstring',669,'eng-GB',2,0,'other belgian-style ales',1),(0,320,148,NULL,NULL,'Recognizing the uniqueness and traditions of several other styles of Belgian Ales, the beers entered in this category will be assessed on the merits that they do not fit existing style guidelines and information that the brewer provides explaining the history and tradition of the style. Balance of character is a key component when assessing these beers. Barrel or wood-aged entries in competitions may be directed to other categories by competition director. In competitions the brewer must provide the historical or regional tradition of the style, or his interpretation of the style, in order to be assessed properly by the judges.','eztext',670,'eng-GB',2,0,'',1),(0,321,148,NULL,NULL,NULL,'ezinteger',671,'eng-GB',2,0,'',1),(0,322,148,NULL,NULL,NULL,'ezinteger',672,'eng-GB',2,0,'',1),(0,323,148,NULL,NULL,NULL,'ezfloat',673,'eng-GB',2,0,'',1),(0,324,148,NULL,NULL,NULL,'ezfloat',674,'eng-GB',2,0,'',1),(0,319,149,NULL,NULL,'French-Style Bire de Garde','ezstring',675,'eng-GB',2,0,'french-style bire de garde',1),(0,320,149,NULL,NULL,'Beers in this category are golden to deep copper or light brown in color. They are light to medium in body. This style of beer is characterized by a toasted malt aroma, slight malt sweetness in flavor, and low to medium hop bitterness. Noble-type hop aromas and flavors should be low to medium. Fruity esters can be light to medium in intensity. Flavor of alcohol is evident. Earthy, cellarlike, musty aromas are okay. Diacetyl should not be perceived but chill haze is okay. Often bottle conditioned with some yeast character. French-Style Bire de Garde may have Brettanomyces characters that are slightly acidity, fruity, horsey, goaty and/or leather-like.','eztext',676,'eng-GB',2,0,'',1),(0,321,149,NULL,20,NULL,'ezinteger',677,'eng-GB',2,20,'',1),(0,322,149,NULL,30,NULL,'ezinteger',678,'eng-GB',2,30,'',1),(0,323,149,4,NULL,NULL,'ezfloat',679,'eng-GB',2,0,'',1),(0,324,149,8,NULL,NULL,'ezfloat',680,'eng-GB',2,0,'',1),(0,319,150,NULL,NULL,'French & Belgian-Style Saison','ezstring',681,'eng-GB',2,0,'french & belgian-style saison',1),(0,320,150,NULL,NULL,'Beers in this category are golden to deep amber in color. There may be quite a variety of characters within this style. Generally: They are light to medium in body. Malt aroma is low to medium-low. Esters are medium to high in  aroma, while, complex alcohols, herbs, spices, low Brettanomyces character and even clove and smoke-like phenolics may or may not be evident in the overall balanced beer. Hop aroma and flavor may be at low to medium levels. Malt flavor is low but provides foundation for the overall balance. Hop bitterness is moderate to moderately assertive. Herb and/or spice flavors, including black pepper-like notes, may or may not be evident. Fruitiness from fermentation is generally in character. A balanced small amount of sour or acidic flavors is acceptable when in balance with other components. Earthy, cellar-like, musty aromas are okay. Diacetyl should not be perceived. Chill or slight yeast haze is okay. Often bottle conditioned with some yeast character and high carbonation. French & Belgian-Style Saison may have Brettanomyces characters that are slightly acidity, fruity, horsey, goaty and/or leather-like.','eztext',682,'eng-GB',2,0,'',1),(0,321,150,NULL,20,NULL,'ezinteger',683,'eng-GB',2,20,'',1),(0,322,150,NULL,40,NULL,'ezinteger',684,'eng-GB',2,40,'',1),(0,323,150,4,NULL,NULL,'ezfloat',685,'eng-GB',2,0,'',1),(0,324,150,8,NULL,NULL,'ezfloat',686,'eng-GB',2,0,'',1),(0,318,151,NULL,NULL,'International Ale Styles','ezstring',687,'eng-GB',2,0,'international ale styles',1),(0,319,152,NULL,NULL,'International-Style Pale Ale','ezstring',688,'eng-GB',2,0,'international-style pale ale',1),(0,320,152,NULL,NULL,'International-style pale ales range from deep golden to copper in color. The style is characterized by wide range of hop characters unlike fruity, floral and citrus-like American-variety hop character and unlike earthy, herbal English-variety hop character. Moderate to high hop bitterness, flavor, and aroma is evident. International pale ales have medium body and low to medium maltiness. Low caramel character is allowable. Fruity-ester flavor and aroma should be moderate to strong. Diacetyl should be absent or present at very low levels. Chill haze is allowable at cold temperatures.','eztext',689,'eng-GB',2,0,'',1),(0,321,152,NULL,30,NULL,'ezinteger',690,'eng-GB',2,30,'',1),(0,322,152,NULL,42,NULL,'ezinteger',691,'eng-GB',2,42,'',1),(0,323,152,4,NULL,NULL,'ezfloat',692,'eng-GB',2,0,'',1),(0,324,152,5,NULL,NULL,'ezfloat',693,'eng-GB',2,0,'',1),(0,319,153,NULL,NULL,'Australasian-Style Pale Ale','ezstring',694,'eng-GB',2,0,'australasian-style pale ale',1),(0,320,153,NULL,NULL,'This style is a mild, pale, light-bodied ale with a color varying from light to amber. Hop bitterness and flavor range from very low to low. Hop aroma is often absent. A fruity or estery aroma should be perceived. Diacetyl should be very low. DMS and chill haze should not present.','eztext',695,'eng-GB',2,0,'',1),(0,321,153,NULL,20,NULL,'ezinteger',696,'eng-GB',2,20,'',1),(0,322,153,NULL,40,NULL,'ezinteger',697,'eng-GB',2,40,'',1),(0,323,153,4,NULL,NULL,'ezfloat',698,'eng-GB',2,0,'',1),(0,324,153,6,NULL,NULL,'ezfloat',699,'eng-GB',2,0,'',1),(0,318,154,NULL,NULL,'European-germanic Lager','ezstring',700,'eng-GB',2,0,'european-germanic lager',1),(0,319,155,NULL,NULL,'German-Style Pilsener','ezstring',701,'eng-GB',2,0,'german-style pilsener',1),(0,320,155,NULL,NULL,'A classic German Pilsener is very light straw or golden in color and well hopped. Perception of hop bitterness is medium to high. Noble-type hop aroma and flavor are moderate and quite obvious. It is a well-attenuated, medium-light bodied beer, but a malty residual sweetness can be perceived in aroma and flavor. Very low levels of sweet corn-like dimethylsulfide (DMS) character are below most beer drinkers\' taste thresholds and are usually not detectable except to the trained or sensitive palate. Other fermentation or hop related sulfur compounds, when perceived at low levels, may be characteristic of this style. Fruity esters and diacetyl should not be perceived. There should be no chill haze. Its head should be dense and rich.','eztext',702,'eng-GB',2,0,'',1),(0,321,155,NULL,25,NULL,'ezinteger',703,'eng-GB',2,25,'',1),(0,322,155,NULL,40,NULL,'ezinteger',704,'eng-GB',2,40,'',1),(0,323,155,4,NULL,NULL,'ezfloat',705,'eng-GB',2,0,'',1),(0,324,155,5,NULL,NULL,'ezfloat',706,'eng-GB',2,0,'',1),(0,319,156,NULL,NULL,'Bohemian-Style Pilsener','ezstring',707,'eng-GB',2,0,'bohemian-style pilsener',1),(0,320,156,NULL,NULL,'Traditional Bohemian Pilseners are medium bodied, and they can be as dark as a light amber color. This style balances moderate bitterness and noble-type hop aroma and flavor with a malty, slightly sweet, medium body. Extremely low levels of diacetyl and low levels of sweet corn-like dimethylsulfide (DMS) character, if perceived, are characteristic of this style and both may accent malt aroma. A toasted-, biscuit-like, bready malt character along with low levels of sulfur compounds may be evident. There should be no chill haze. Its head should be dense and rich.','eztext',708,'eng-GB',2,0,'',1),(0,321,156,NULL,30,NULL,'ezinteger',709,'eng-GB',2,30,'',1),(0,322,156,NULL,45,NULL,'ezinteger',710,'eng-GB',2,45,'',1),(0,323,156,4,NULL,NULL,'ezfloat',711,'eng-GB',2,0,'',1),(0,324,156,5,NULL,NULL,'ezfloat',712,'eng-GB',2,0,'',1),(0,319,157,NULL,NULL,'European Low-Alcohol Lager / German Leicht(bier)','ezstring',713,'eng-GB',2,0,'european low-alcohol lager / german leicht(bier)',1),(0,320,157,NULL,NULL,'These beers are very light in body and color. Malt sweetness is perceived at low to medium levels, while hop bitterness character is perceived at medium levels. Hop flavor and aroma may be low to medium. These beers should be clean with no perceived fruity esters or diacetyl. Very low levels of sulfur related compounds acceptable. Chill haze is not acceptable.','eztext',714,'eng-GB',2,0,'',1),(0,321,157,NULL,16,NULL,'ezinteger',715,'eng-GB',2,16,'',1),(0,322,157,NULL,24,NULL,'ezinteger',716,'eng-GB',2,24,'',1),(0,323,157,2,NULL,NULL,'ezfloat',717,'eng-GB',2,0,'',1),(0,324,157,3,NULL,NULL,'ezfloat',718,'eng-GB',2,0,'',1),(0,319,158,NULL,NULL,'Mnchner (Munich)-Style Helles','ezstring',719,'eng-GB',2,0,'mnchner (munich)-style helles',1),(0,320,158,NULL,NULL,'This beer should be perceived as having low bitterness. It is a medium-bodied, malt-emphasized beer with malt character often balanced with low levels of yeast produced sulfur compounds (character). Certain renditions of this beer style have  a perceivable level of hop flavor (note: hop flavor does not imply hop bitterness) and character but it is essentially balanced with malt character to retain its style identity. Malt character is sometimes bread-like yet always reminiscent of freshly and very lightly toasted malted barley. There should not be any caramel character. Color is light straw to golden. Fruity esters and diacetyl should not be perceived. There should be no chill haze.','eztext',720,'eng-GB',2,0,'',1),(0,321,158,NULL,18,NULL,'ezinteger',721,'eng-GB',2,18,'',1),(0,322,158,NULL,25,NULL,'ezinteger',722,'eng-GB',2,25,'',1),(0,323,158,4,NULL,NULL,'ezfloat',723,'eng-GB',2,0,'',1),(0,324,158,5,NULL,NULL,'ezfloat',724,'eng-GB',2,0,'',1),(0,319,159,NULL,NULL,'Dortmunder / European-Style Export','ezstring',725,'eng-GB',2,0,'dortmunder / european-style export',1),(0,320,159,NULL,NULL,'Dortmunder has medium hop bitterness. Hop flavor and aroma from noble hops are perceptible but low. Sweet malt flavor can be low and should not be caramel-like. The color of this style is straw to deep golden. The body will be medium bodied. Fruity esters, chill haze, and diacetyl should not be perceived.','eztext',726,'eng-GB',2,0,'',1),(0,321,159,NULL,23,NULL,'ezinteger',727,'eng-GB',2,23,'',1),(0,322,159,NULL,29,NULL,'ezinteger',728,'eng-GB',2,29,'',1),(0,323,159,5,NULL,NULL,'ezfloat',729,'eng-GB',2,0,'',1),(0,324,159,6,NULL,NULL,'ezfloat',730,'eng-GB',2,0,'',1),(0,319,160,NULL,NULL,'Vienna-Style Lager','ezstring',731,'eng-GB',2,0,'vienna-style lager',1),(0,320,160,NULL,NULL,'Beers in this category are reddish brown or copper colored. They are medium in body. The beer is characterized by malty aroma and slight malt sweetness. The malt aroma and flavor should have a notable degree of toasted and/or slightly roasted malt character. Hop bitterness is clean and crisp. Noble-type hop aromas and flavors should be low or mild. Diacetyl, chill haze and ale-like fruity esters should not be perceived.','eztext',732,'eng-GB',2,0,'',1),(0,321,160,NULL,22,NULL,'ezinteger',733,'eng-GB',2,22,'',1),(0,322,160,NULL,28,NULL,'ezinteger',734,'eng-GB',2,28,'',1),(0,323,160,4,NULL,NULL,'ezfloat',735,'eng-GB',2,0,'',1),(0,324,160,5,NULL,NULL,'ezfloat',736,'eng-GB',2,0,'',1),(0,319,161,NULL,NULL,'German-Style Mrzen','ezstring',737,'eng-GB',2,0,'german-style mrzen',1),(0,320,161,NULL,NULL,'Mrzens are characterized by a medium body and broad range of color. They can range from golden to reddish orange. Sweet maltiness should dominate slightly over a clean hop bitterness. Malt character should be light-toasted rather than strongly caramel (though a low level of light caramel character is acceptable). Bread or biscuit-like malt character is acceptable in aroma and flavor. Hop aroma and flavor should be low but notable. Ale-like fruity esters should not be perceived. Diacetyl and chill haze should not be perceived.','eztext',738,'eng-GB',2,0,'',1),(0,321,161,NULL,18,NULL,'ezinteger',739,'eng-GB',2,18,'',1),(0,322,161,NULL,25,NULL,'ezinteger',740,'eng-GB',2,25,'',1),(0,323,161,5,NULL,NULL,'ezfloat',741,'eng-GB',2,0,'',1),(0,324,161,5,NULL,NULL,'ezfloat',742,'eng-GB',2,0,'',1),(0,319,162,NULL,NULL,'German-Style Oktoberfest / Wiesen (Meadow)','ezstring',743,'eng-GB',2,0,'german-style oktoberfest / wiesen (meadow)',1),(0,320,162,NULL,NULL,'Today\'s Oktoberfest beers are characterized by a medium body and light, golden color. Sweet maltiness is mild with an equalizing balance of clean, hop bitterness. Hop aroma and flavor should be low but notable. Ale-like fruity esters should not be perceived. Diacetyl and chill haze should not be perceived. Similar or equal to Dortmunder/European-Style Export','eztext',744,'eng-GB',2,0,'',1),(0,321,162,NULL,23,NULL,'ezinteger',745,'eng-GB',2,23,'',1),(0,322,162,NULL,29,NULL,'ezinteger',746,'eng-GB',2,29,'',1),(0,323,162,5,NULL,NULL,'ezfloat',747,'eng-GB',2,0,'',1),(0,324,162,6,NULL,NULL,'ezfloat',748,'eng-GB',2,0,'',1),(0,319,163,NULL,NULL,'European-Style Dark / Mnchner Dunkel','ezstring',749,'eng-GB',2,0,'european-style dark / mnchner dunkel',1),(0,320,163,NULL,NULL,'These light brown to dark brown beers have a pronounced malty aroma and flavor that dominates over the clean, crisp, moderate hop bitterness. This beer does not offer an overly sweet impression, but rather a mild balance between malt sweetness, hop bitterness and light to moderate mouthfeel. A classic Mnchner Dunkel should have chocolate-like, roast malt, bread-like or biscuit-like aroma that comes from the use of Munich dark malt. Chocolate or roast malts can be used, but the percentage used should be minimal. Noble-type hop flavor and aroma should be low but perceptible. Diacetyl should not be perceived. Ale-like fruity esters and chill haze should not be perceived.','eztext',750,'eng-GB',2,0,'',1),(0,321,163,NULL,16,NULL,'ezinteger',751,'eng-GB',2,16,'',1),(0,322,163,NULL,25,NULL,'ezinteger',752,'eng-GB',2,25,'',1),(0,323,163,4,NULL,NULL,'ezfloat',753,'eng-GB',2,0,'',1),(0,324,163,5,NULL,NULL,'ezfloat',754,'eng-GB',2,0,'',1),(0,319,164,NULL,NULL,'German-Style Schwarzbier','ezstring',755,'eng-GB',2,0,'german-style schwarzbier',1),(0,320,164,NULL,NULL,'These very dark brown to black beers have a mild roasted malt character without the associated bitterness. This is not a fullbodied beer, but rather a moderate body gently enhances malt flavor and aroma with low to moderate levels of sweetness. Hop bitterness is low to medium in character. Noble-type hop flavor and aroma should be low but perceptible. There should be no fruity esters. Diacetyl should not be perceived.','eztext',756,'eng-GB',2,0,'',1),(0,321,164,NULL,22,NULL,'ezinteger',757,'eng-GB',2,22,'',1),(0,322,164,NULL,30,NULL,'ezinteger',758,'eng-GB',2,30,'',1),(0,323,164,3,NULL,NULL,'ezfloat',759,'eng-GB',2,0,'',1),(0,324,164,5,NULL,NULL,'ezfloat',760,'eng-GB',2,0,'',1),(0,319,165,NULL,NULL,'Bamberg-Style Mrzen Rauchbier','ezstring',761,'eng-GB',2,0,'bamberg-style mrzen rauchbier',1),(0,320,165,NULL,NULL,'Bamberg-style Rauchbier Mrzen should have beechwood smoky characters that range from detectable to prevalent in the aroma and flavor. Smoke character is neither harshly phenolic nor acrid, but rather very smooth, almost rendering a perception of mild sweetness to this style of beer. The beer is generally toasted malty sweet and full-bodied with low to medium-low hop bitterness. Noble-type hop flavor is low but may be perceptible. The aroma should strike a balance between malt, hop, and smoke. Fruity esters, diacetyl, and chill haze should not be perceived.','eztext',762,'eng-GB',2,0,'',1),(0,321,165,NULL,18,NULL,'ezinteger',763,'eng-GB',2,18,'',1),(0,322,165,NULL,25,NULL,'ezinteger',764,'eng-GB',2,25,'',1),(0,323,165,5,NULL,NULL,'ezfloat',765,'eng-GB',2,0,'',1),(0,324,165,5,NULL,NULL,'ezfloat',766,'eng-GB',2,0,'',1),(0,319,166,NULL,NULL,'Bamberg-Style Helles Rauchbier','ezstring',767,'eng-GB',2,0,'bamberg-style helles rauchbier',1),(0,320,166,NULL,NULL,'Helles Rauchbier should have beech wood smoky characters that range from detectable to prevalent in the aroma and flavor. Smoke character is not harshly phenolic, but rather very smooth, almost rendering a perception of mild sweetness to this style of beer. This is a medium-bodied, smoke and malt-emphasized beer, with malt character often balanced with low levels of yeast produced sulfur compounds (character). This beer should be perceived as having low bitterness. Certain renditions of this beer style approach a perceivable level of hop flavor (note: hop flavor does not imply hop bitterness) and character but it is essentially balanced with malt character to retain its style identity. Helles Rauchbier malt character is reminiscent of freshly and very lightly toasted sweet malted barley. There should not be any caramel character. Color is light straw to golden. Noble-type hop flavor is low but may be perceptible. The aroma should strike a balance between malt, hop, and smoke. Fruity esters, diacetyl, and chill haze should not be perceived.','eztext',768,'eng-GB',2,0,'',1),(0,321,166,NULL,18,NULL,'ezinteger',769,'eng-GB',2,18,'',1),(0,322,166,NULL,25,NULL,'ezinteger',770,'eng-GB',2,25,'',1),(0,323,166,4,NULL,NULL,'ezfloat',771,'eng-GB',2,0,'',1),(0,324,166,5,NULL,NULL,'ezfloat',772,'eng-GB',2,0,'',1),(0,319,167,NULL,NULL,'Bamberg-Style Bock Rauchbier','ezstring',773,'eng-GB',2,0,'bamberg-style bock rauchbier',1),(0,320,167,NULL,NULL,'Bamberg-style Bock Rauchbier should have beech wood smoky characters that range from detectable to prevalent in the aroma and flavor. Smoke character is not harshly phenolic, but rather very smooth, almost rendering a perception of mild sweetness to this style of beer. The Bock beer character should manifest itself as a strong, malty, medium- to full-bodied with moderate hop bitterness that should increase proportionately with the starting gravity. Hop flavor should be low and hop aroma should be very low. Bocks can range in color from deep copper to dark brown. Fruity esters should be minimal. Diacetyl and chill haze should not be perceived.','eztext',774,'eng-GB',2,0,'',1),(0,321,167,NULL,20,NULL,'ezinteger',775,'eng-GB',2,20,'',1),(0,322,167,NULL,30,NULL,'ezinteger',776,'eng-GB',2,30,'',1),(0,323,167,6,NULL,NULL,'ezfloat',777,'eng-GB',2,0,'',1),(0,324,167,7,NULL,NULL,'ezfloat',778,'eng-GB',2,0,'',1),(0,319,168,NULL,NULL,'Traditional German-Style Bock','ezstring',779,'eng-GB',2,0,'traditional german-style bock',1),(0,320,168,NULL,NULL,'Traditional bocks are made with all malt and are strong, malty, medium- to full-bodied, bottom-fermented beers with moderate hop bitterness that should increase proportionately with the starting gravity. Malt character should be a balance of sweetness and toasted/nut-like malt; not caramel. Hop flavor should be low and hop aroma should be very low. Bocks can range in color from deep copper to dark brown. Fruity esters should be minimal. Diacetyl should be absent.','eztext',780,'eng-GB',2,0,'',1),(0,321,168,NULL,20,NULL,'ezinteger',781,'eng-GB',2,20,'',1),(0,322,168,NULL,30,NULL,'ezinteger',782,'eng-GB',2,30,'',1),(0,323,168,6,NULL,NULL,'ezfloat',783,'eng-GB',2,0,'',1),(0,324,168,7,NULL,NULL,'ezfloat',784,'eng-GB',2,0,'',1),(0,319,169,NULL,NULL,'German-Style Heller Bock/Maibock','ezstring',785,'eng-GB',2,0,'german-style heller bock/maibock',1),(0,320,169,NULL,NULL,'The German word helle means light colored, and as such, a heller Bock is light straw to deep golden in color. Maibocks are also light-colored bocks. The sweet malty character should come through in the aroma and flavor. A lightly toasted and/or bready malt character is often evident. Roast or heavy toast/caramel malt character should be absent. Body is medium to full. Hop bitterness should be low, while noble-type hop aroma and flavor may be at low to medium levels. Bitterness increases with gravity. Fruity esters may be perceived at low levels. Diacetyl should be absent. Chill haze should not be perceived.','eztext',786,'eng-GB',2,0,'',1),(0,321,169,NULL,20,NULL,'ezinteger',787,'eng-GB',2,20,'',1),(0,322,169,NULL,38,NULL,'ezinteger',788,'eng-GB',2,38,'',1),(0,323,169,6,NULL,NULL,'ezfloat',789,'eng-GB',2,0,'',1),(0,324,169,8,NULL,NULL,'ezfloat',790,'eng-GB',2,0,'',1),(0,319,170,NULL,NULL,'German-Style Doppelbock','ezstring',791,'eng-GB',2,0,'german-style doppelbock',1),(0,320,170,NULL,NULL,'Malty sweetness is dominant but should not be cloying. Malt character is more reminiscent of fresh and lightly toasted Munich- style malt, more so than caramel or toffee malt character. Some elements of caramel and toffee can be evident and contribute to complexity, but the predominant malt character is an expression of toasted barley malt. Doppelbocks are full bodied and deep amber to dark brown in color. Astringency from roast malts is absent. Alcoholic strength is high, and hop rates increase with gravity. Hop bitterness and flavor should be low and hop aroma absent. Fruity esters are commonly perceived but at low to moderate levels. Diacetyl should be absent','eztext',792,'eng-GB',2,0,'',1),(0,321,170,NULL,17,NULL,'ezinteger',793,'eng-GB',2,17,'',1),(0,322,170,NULL,27,NULL,'ezinteger',794,'eng-GB',2,27,'',1),(0,323,170,6,NULL,NULL,'ezfloat',795,'eng-GB',2,0,'',1),(0,324,170,8,NULL,NULL,'ezfloat',796,'eng-GB',2,0,'',1),(0,319,171,NULL,NULL,'German-Style Eisbock','ezstring',797,'eng-GB',2,0,'german-style eisbock',1),(0,320,171,NULL,NULL,'A stronger version of Doppelbock. Malt character can be very sweet. The body is very full and deep copper to almost black in color. Alcoholic strength is very high. Hop bitterness is subdued. Hop flavor and aroma are absent. Fruity esters may be evident but not overpowering. Typically these beers are brewed by freezing a Doppelbock and removing resulting ice to increase alcohol content. Diacetyl should be absent','eztext',798,'eng-GB',2,0,'',1),(0,321,171,NULL,NULL,NULL,'ezinteger',799,'eng-GB',2,0,'',1),(0,322,171,NULL,50,NULL,'ezinteger',800,'eng-GB',2,50,'',1),(0,323,171,NULL,NULL,NULL,'ezfloat',801,'eng-GB',2,0,'',1),(0,324,171,33,NULL,NULL,'ezfloat',802,'eng-GB',2,0,'',1),(0,319,172,NULL,NULL,'Kellerbier (Cellar beer) or Zwickelbier - Lager','ezstring',803,'eng-GB',2,0,'kellerbier (cellar beer) or zwickelbier - lager',1),(0,320,172,NULL,NULL,'Traditional Version of Kellerbier: Unfiltered lagered versions of Germanic lager styles of beer such as Mnchner-Style Helles and Dunkel, Dortmunder/European-Style Export, Bohemian-style Pilsener and German-style Pilsener. Kellerbier is noticeably less carbonated. Subtle or low levels of esters may be apparent. This is an unfiltered beer but it may be naturally clear due to settling of yeast during aging. They may or may not be clear. Exhibiting a small amount of yeast haze in the appearance is acceptable. Low to moderately low levels of yeast-generated sulfur compounds in aroma and flavor should be apparent, and low levels of acetaldehyde or other volatiles normally scrubbed during fermentation may or may not be apparent. The sulfur and acetaldehyde characters should contribute positively to the beer drinking experience. There should be no diacetyl detectable. Dry hopping is acceptable. Head retention may not be optimal. Contemporary Version of Kellerbier: Beers that are packaged or on draft which are unfiltered versions of other lager styles. These may share many attributes of traditional versions, but are generally fully carbonated, fully lagered, with full head retention and absent of acetaldehyde.','eztext',804,'eng-GB',2,0,'',1),(0,321,172,NULL,NULL,NULL,'ezinteger',805,'eng-GB',2,0,'',1),(0,322,172,NULL,NULL,NULL,'ezinteger',806,'eng-GB',2,0,'',1),(0,323,172,NULL,NULL,NULL,'ezfloat',807,'eng-GB',2,0,'',1),(0,324,172,NULL,NULL,NULL,'ezfloat',808,'eng-GB',2,0,'',1),(0,318,173,NULL,NULL,'North American Lager','ezstring',809,'eng-GB',2,0,'north american lager',1),(0,319,174,NULL,NULL,'American-Style Lager','ezstring',810,'eng-GB',2,0,'american-style lager',1),(0,320,174,NULL,NULL,'Light in body and very light to straw in color, American lagers are very clean and crisp and aggressively carbonated. Flavor components should b e subtle and complex, with no one ingredient dominating the others. Malt sweetness is light to mild. Corn, rice, or other grain or sugar adjuncts are often used. Hop bitterness, flavor and aroma are negligible to very light. Light fruity esters are acceptable. Chill haze and diacetyl should be absent.','eztext',811,'eng-GB',2,0,'',1),(0,321,174,NULL,5,NULL,'ezinteger',812,'eng-GB',2,5,'',1),(0,322,174,NULL,13,NULL,'ezinteger',813,'eng-GB',2,13,'',1),(0,323,174,3,NULL,NULL,'ezfloat',814,'eng-GB',2,0,'',1),(0,324,174,5,NULL,NULL,'ezfloat',815,'eng-GB',2,0,'',1),(0,319,175,NULL,NULL,'American-Style Light (Low Calorie) Lager','ezstring',816,'eng-GB',2,0,'american-style light (low calorie) lager',1),(0,320,175,NULL,NULL,'These beers are extremely light colored, light in body, and high in carbonation. Calorie level should not exceed 125 per 12 ounce serving. Corn, rice, or other grain or sugar adjuncts are often used. Flavor is mild and hop bitterness and aroma is negligible to very low. Light fruity esters are acceptable. Chill haze and diacetyl should be absent.','eztext',817,'eng-GB',2,0,'',1),(0,321,175,NULL,5,NULL,'ezinteger',818,'eng-GB',2,5,'',1),(0,322,175,NULL,10,NULL,'ezinteger',819,'eng-GB',2,10,'',1),(0,323,175,3,NULL,NULL,'ezfloat',820,'eng-GB',2,0,'',1),(0,324,175,4,NULL,NULL,'ezfloat',821,'eng-GB',2,0,'',1),(0,319,176,NULL,NULL,'American-Style Low-Carbohydrate Light Lager','ezstring',822,'eng-GB',2,0,'american-style low-carbohydrate light lager',1),(0,320,176,NULL,NULL,'These beers are extremely light straw to light amber in color, light in body, and high in carbonation. They should have a maximum carbohydrate level of 3.0 gm per 12 oz. (356 ml). These beers are characterized by extremely high degree of attenuation (often final gravity is less than 1.000 (0 Plato), but with typical American-style light lager alcohol levels. Corn, rice, or other grain adjuncts are often used. Flavor is very light/mild and very dry. Hop flavor, aroma and bitterness are negligible to very low. Very low yeasty flavors and fruity esters are acceptable in aroma and flavor. Chill haze and diacetyl should not be perceived.','eztext',823,'eng-GB',2,0,'',1),(0,321,176,NULL,3,NULL,'ezinteger',824,'eng-GB',2,3,'',1),(0,322,176,NULL,10,NULL,'ezinteger',825,'eng-GB',2,10,'',1),(0,323,176,3,NULL,NULL,'ezfloat',826,'eng-GB',2,0,'',1),(0,324,176,4,NULL,NULL,'ezfloat',827,'eng-GB',2,0,'',1),(0,319,177,NULL,NULL,'American-Style Amber (Low Calorie) Lager','ezstring',828,'eng-GB',2,0,'american-style amber (low calorie) lager',1),(0,320,177,NULL,NULL,'These beers are pale golden to amber in color, light to medium-light in body, and high in carbonation. Calorie level should not exceed 125 per 12 ounce serving. Corn, rice, or other grain or sugar adjuncts may be used but all malt formulations are also made. Malt and hop flavors are mild yet evident. Hop bitterness is evident and hop aroma may be negligible to evident. Light fruity esters are acceptable. Chill haze and diacetyl should be absent.','eztext',829,'eng-GB',2,0,'',1),(0,321,177,NULL,8,NULL,'ezinteger',830,'eng-GB',2,8,'',1),(0,322,177,NULL,15,NULL,'ezinteger',831,'eng-GB',2,15,'',1),(0,323,177,3,NULL,NULL,'ezfloat',832,'eng-GB',2,0,'',1),(0,324,177,4,NULL,NULL,'ezfloat',833,'eng-GB',2,0,'',1),(0,319,178,NULL,NULL,'American-Style Premium Lager','ezstring',834,'eng-GB',2,0,'american-style premium lager',1),(0,320,178,NULL,NULL,'This style has low malt (and adjunct) sweetness, is medium bodied, and should contain no or a low percentage (less than 25%) of adjuncts. Color may be light straw to golden. Alcohol content and bitterness may also be greater. Hop aroma and flavor is low or negligible. Light fruity esters are acceptable. Chill haze and diacetyl should be absent. Note: Some beers marketed as \"premium\" (based on price) may not fit this definition.','eztext',835,'eng-GB',2,0,'',1),(0,321,178,NULL,6,NULL,'ezinteger',836,'eng-GB',2,6,'',1),(0,322,178,NULL,15,NULL,'ezinteger',837,'eng-GB',2,15,'',1),(0,323,178,4,NULL,NULL,'ezfloat',838,'eng-GB',2,0,'',1),(0,324,178,5,NULL,NULL,'ezfloat',839,'eng-GB',2,0,'',1),(0,319,179,NULL,NULL,'American-Style Pilsener','ezstring',840,'eng-GB',2,0,'american-style pilsener',1),(0,320,179,NULL,NULL,'This classic and unique pre-Prohibition American-style Pilsener is straw to deep gold in color. Hop bitterness, flavor and aroma are medium to high, and use of noble-type hops for flavor and aroma is preferred. Up to 25 percent corn and/or rice in the grist should be used. Malt flavor and aroma are medium. This is a light-medium to medium-bodied beer. Sweet corn-like dimethylsulfide (DMS), fruity esters and American hop-derived citrus flavors or aromas should not be perceived. Diacetyl is not acceptable. There should be no chill haze. Competition organizers may wish to subcategorize this style into rice and corn subcategories.','eztext',841,'eng-GB',2,0,'',1),(0,321,179,NULL,25,NULL,'ezinteger',842,'eng-GB',2,25,'',1),(0,322,179,NULL,40,NULL,'ezinteger',843,'eng-GB',2,40,'',1),(0,323,179,5,NULL,NULL,'ezfloat',844,'eng-GB',2,0,'',1),(0,324,179,6,NULL,NULL,'ezfloat',845,'eng-GB',2,0,'',1),(0,319,180,NULL,NULL,'American-Style Ice Lager','ezstring',846,'eng-GB',2,0,'american-style ice lager',1),(0,320,180,NULL,NULL,'This style is slightly higher in alcohol than most other light-colored, American-style lagers. Its body is low to medium and has low residual malt sweetness. It has few or no adjuncts. Color is very pale to golden. Hop bitterness is low but certainly perceptible. Hop aroma and flavor are low. Chill haze, fruity esters, and diacetyl should not be perceived. Typically these beers are chilled before filtration so that ice crystals (which may or may not be removed) are formed. This can contribute to a higher alcohol content (up to 0.5% more).','eztext',847,'eng-GB',2,0,'',1),(0,321,180,NULL,7,NULL,'ezinteger',848,'eng-GB',2,7,'',1),(0,322,180,NULL,20,NULL,'ezinteger',849,'eng-GB',2,20,'',1),(0,323,180,4,NULL,NULL,'ezfloat',850,'eng-GB',2,0,'',1),(0,324,180,6,NULL,NULL,'ezfloat',851,'eng-GB',2,0,'',1),(0,319,181,NULL,NULL,'American-Style Malt Liquor','ezstring',852,'eng-GB',2,0,'american-style malt liquor',1),(0,320,181,NULL,NULL,'High in starting gravity and alcoholic strength, this style is somewhat diverse. Some American malt liquors are just slightly stronger than American lagers, while others approach bock strength. Some residual sweetness is perceived. Hop rates are very low, contributing little bitterness and virtually no hop aroma or flavor. Perception of sweet-fruity esters and complex alcohols (though not solvent-like) are acceptable at low levels. Chill haze and diacetyl should not be perceived.','eztext',853,'eng-GB',2,0,'',1),(0,321,181,NULL,12,NULL,'ezinteger',854,'eng-GB',2,12,'',1),(0,322,181,NULL,23,NULL,'ezinteger',855,'eng-GB',2,23,'',1),(0,323,181,6,NULL,NULL,'ezfloat',856,'eng-GB',2,0,'',1),(0,324,181,7,NULL,NULL,'ezfloat',857,'eng-GB',2,0,'',1),(0,319,182,NULL,NULL,'American-Style Amber Lager','ezstring',858,'eng-GB',2,0,'american-style amber lager',1),(0,320,182,NULL,NULL,'American-style amber lagers are light amber to amber or copper colored. They are medium bodied. There is a noticeable degree of caramel-type malt character in flavor and often in aroma. This is a broad category in which the hop bitterness, flavor, and aroma may be accentuated or may only be present at relatively low levels, yet noticeable. Fruity esters, diacetyl, and chill haze should be absent.','eztext',859,'eng-GB',2,0,'',1),(0,321,182,NULL,18,NULL,'ezinteger',860,'eng-GB',2,18,'',1),(0,322,182,NULL,30,NULL,'ezinteger',861,'eng-GB',2,30,'',1),(0,323,182,4,NULL,NULL,'ezfloat',862,'eng-GB',2,0,'',1),(0,324,182,5,NULL,NULL,'ezfloat',863,'eng-GB',2,0,'',1),(0,319,183,NULL,NULL,'American-Style Mrzen / Oktoberfest','ezstring',864,'eng-GB',2,0,'american-style mrzen / oktoberfest',1),(0,320,183,NULL,NULL,'The American style of these classic German beers is distinguished by a comparatively greater degree of hop character. In general the style is characterized by a medium body and broad range of color from golden to reddish brown. Sweet maltiness should dominate over clean hop bitterness. The bitterness should not be aggressive or harsh. Malt character should be light-toasted rather than strongly caramel (though a low level of light caramel character is acceptable). Bread or biscuit-like malt character is acceptable in aroma and flavor. Hop aroma and flavor should be notable but at low to medium levels. Fruity esters should not be perceived. Diacetyl and chill haze should not be perceived.','eztext',865,'eng-GB',2,0,'',1),(0,321,183,NULL,20,NULL,'ezinteger',866,'eng-GB',2,20,'',1),(0,322,183,NULL,30,NULL,'ezinteger',867,'eng-GB',2,30,'',1),(0,323,183,5,NULL,NULL,'ezfloat',868,'eng-GB',2,0,'',1),(0,324,183,5,NULL,NULL,'ezfloat',869,'eng-GB',2,0,'',1),(0,319,184,NULL,NULL,'American-Style Dark Lager','ezstring',870,'eng-GB',2,0,'american-style dark lager',1),(0,320,184,NULL,NULL,'This beer\'s malt aroma and flavor are low but notable. Its color ranges from a very deep copper to a deep, dark brown. It has a clean, light body with discreet contributions from caramel and roasted malts. Non-malt adjuncts are often used, and hop rates are low. Hop bitterness is clean and has a short duration of impact. Hop flavor, and aroma are low. Carbonation is high. Fruity esters, diacetyl, and chill haze should not be perceived.','eztext',871,'eng-GB',2,0,'',1),(0,321,184,NULL,14,NULL,'ezinteger',872,'eng-GB',2,14,'',1),(0,322,184,NULL,20,NULL,'ezinteger',873,'eng-GB',2,20,'',1),(0,323,184,4,NULL,NULL,'ezfloat',874,'eng-GB',2,0,'',1),(0,324,184,5,NULL,NULL,'ezfloat',875,'eng-GB',2,0,'',1),(0,318,185,NULL,NULL,'Other Lager','ezstring',876,'eng-GB',2,0,'other lager',1),(0,319,186,NULL,NULL,'Baltic-Style Porter','ezstring',877,'eng-GB',2,0,'baltic-style porter',1),(0,320,186,NULL,NULL,'A true smooth cold-fermented and cold lagered beer, brewed with lager yeast. Black to very deep ruby/garnet in color. Overall, Baltic Porters have a very smooth lagered character with distinctive caramelized sugars, licorice and chocolate-like character of roasted malts and dark sugars. Roasted dark malts should not contribute bitterness, or astringent roast character. A low degree of smokiness from malt may be evident. Debitterized roast malts are best used for this style. Because of its alcoholic strength, aroma may include gentle (low) lager fruitiness (berries, grapes, plums, not banana; ale-like fruitiness from warm temperature fermentation is not appropriate), complex alcohols, cocoa-like, roast malt (and sometimes coffee-like roast barley, yet not bitter). Hop aroma is very low, though a hint of floral or sweet hop aroma can complement aromatics and flavor without dominance. Baltic Porters are not hop bitter dominated and expressed as low to medium-low. Baltic porters range from having medium to full body complemented with a medium-low to medium level of malty sweetness. No butterscotch-like diacetyl or sweet corn-like dimethylsulfide (DMS) should be apparent in aroma or flavor.','eztext',878,'eng-GB',2,0,'',1),(0,321,186,NULL,35,NULL,'ezinteger',879,'eng-GB',2,35,'',1),(0,322,186,NULL,40,NULL,'ezinteger',880,'eng-GB',2,40,'',1),(0,323,186,7,NULL,NULL,'ezfloat',881,'eng-GB',2,0,'',1),(0,324,186,9,NULL,NULL,'ezfloat',882,'eng-GB',2,0,'',1),(0,319,187,NULL,NULL,'Australasian, Latin American or Tropical-Style Light Lager','ezstring',883,'eng-GB',2,0,'australasian, latin american or tropical-style light lager',1),(0,320,187,NULL,NULL,'Australasian or Tropical light lagers are very light in color and light bodied. They have no hop flavor or aroma, and hop bitterness is negligibly to moderately perceived. Sugar adjuncts are often used to lighten the body and flavor, sometimes contributing to a slight apple-like-like fruity ester. Sugar, corn, rice, and other cereal grains are used as an adjunct. Chill haze and diacetyl should be absent. Fruity esters should be very low.','eztext',884,'eng-GB',2,0,'',1),(0,321,187,NULL,9,NULL,'ezinteger',885,'eng-GB',2,9,'',1),(0,322,187,NULL,18,NULL,'ezinteger',886,'eng-GB',2,18,'',1),(0,323,187,3,NULL,NULL,'ezfloat',887,'eng-GB',2,0,'',1),(0,324,187,5,NULL,NULL,'ezfloat',888,'eng-GB',2,0,'',1),(0,318,188,NULL,NULL,'International Styles','ezstring',889,'eng-GB',2,0,'international styles',1),(0,319,189,NULL,NULL,'International-Style Pilsener','ezstring',890,'eng-GB',2,0,'international-style pilsener',1),(0,320,189,NULL,NULL,'International Pilseners are straw/golden in color and are well attenuated. This medium-bodied beer is often brewed with rice, corn, wheat, or other grain or sugar adjuncts making up part of the mash. Hop bitterness is low to medium. Hop flavor and aroma are low. Residual malt sweetness is low--it does not predominate but may be perceived. Fruity esters and diacetyl should not be perceived. Very low levels of sweet corn-like dimethylsulfide (DMS) character, if perceived, are acceptable. There should be no chill haze.','eztext',891,'eng-GB',2,0,'',1),(0,321,189,NULL,17,NULL,'ezinteger',892,'eng-GB',2,17,'',1),(0,322,189,NULL,30,NULL,'ezinteger',893,'eng-GB',2,30,'',1),(0,323,189,4,NULL,NULL,'ezfloat',894,'eng-GB',2,0,'',1),(0,324,189,5,NULL,NULL,'ezfloat',895,'eng-GB',2,0,'',1),(0,319,190,NULL,NULL,'Dry Lager','ezstring',896,'eng-GB',2,0,'dry lager',1),(0,320,190,NULL,NULL,'This straw-colored lager lacks sweetness, is light in body, and is only mildly flavored by malt. Its alcoholic strength may contribute to the overall flavor character. Bitterness is low and carbonation is high. Chill haze, fruity esters, and diacetyl should be absent.','eztext',897,'eng-GB',2,0,'',1),(0,321,190,NULL,15,NULL,'ezinteger',898,'eng-GB',2,15,'',1),(0,322,190,NULL,23,NULL,'ezinteger',899,'eng-GB',2,23,'',1),(0,323,190,4,NULL,NULL,'ezfloat',900,'eng-GB',2,0,'',1),(0,324,190,5,NULL,NULL,'ezfloat',901,'eng-GB',2,0,'',1),(0,318,191,NULL,NULL,'Hybrid/mixed Beer','ezstring',902,'eng-GB',2,0,'hybrid/mixed beer',1),(0,319,192,NULL,NULL,'Session Beer','ezstring',903,'eng-GB',2,0,'session beer',1),(0,320,192,NULL,NULL,'Any style of beer can be made lower in strength than described in the classic style guidelines. The goal should be to reach a balance between the style\'s character and the lower alcohol content. Drinkability is a character in the overall balance of these beers. Beers in this category must not exceed 4.1% alcohol by weight (5.1% alcohol by volume).','eztext',904,'eng-GB',2,0,'',1),(0,321,192,NULL,10,NULL,'ezinteger',905,'eng-GB',2,10,'',1),(0,322,192,NULL,30,NULL,'ezinteger',906,'eng-GB',2,30,'',1),(0,323,192,4,NULL,NULL,'ezfloat',907,'eng-GB',2,0,'',1),(0,324,192,5,NULL,NULL,'ezfloat',908,'eng-GB',2,0,'',1),(0,319,193,NULL,NULL,'American-Style Cream Ale or Lager','ezstring',909,'eng-GB',2,0,'american-style cream ale or lager',1),(0,320,193,NULL,NULL,'Mild, pale, light-bodied ale, made using a warm fermentation (top or bottom) and cold lagering. Hop bitterness and flavor range from very low to low. Hop aroma is often absent. Sometimes referred to as cream ales, these beers are crisp and refreshing. Pale malt character predominates. Caramelized malt character should be absent. A fruity or estery aroma may be perceived. Diacetyl and chill haze should not be perceived. Sulfur character and/or sweet corn-like dimethylsulfide (DMS) should be extremely low or absent from this style of beer.','eztext',910,'eng-GB',2,0,'',1),(0,321,193,NULL,10,NULL,'ezinteger',911,'eng-GB',2,10,'',1),(0,322,193,NULL,22,NULL,'ezinteger',912,'eng-GB',2,22,'',1),(0,323,193,4,NULL,NULL,'ezfloat',913,'eng-GB',2,0,'',1),(0,324,193,5,NULL,NULL,'ezfloat',914,'eng-GB',2,0,'',1),(0,319,194,NULL,NULL,'California Common Beer','ezstring',915,'eng-GB',2,0,'california common beer',1),(0,320,194,NULL,NULL,'California Common Beer is light amber to amber in color and is medium bodied. There is a noticeable degree of caramel-type malt character in flavor and often in aroma. Hop bitterness impression is medium to medium high and is balanced with a low to medium-low degree of fruity esters and malt character and give an impression of balance and drinkability. Hop flavor and aroma is low to medium-low. California Common Beer is a style of beer brewed with lager yeasts but at ale fermentation temperatures. Diacetyl and chill haze should be absent.','eztext',916,'eng-GB',2,0,'',1),(0,321,194,NULL,35,NULL,'ezinteger',917,'eng-GB',2,35,'',1),(0,322,194,NULL,45,NULL,'ezinteger',918,'eng-GB',2,45,'',1),(0,323,194,4,NULL,NULL,'ezfloat',919,'eng-GB',2,0,'',1),(0,324,194,5,NULL,NULL,'ezfloat',920,'eng-GB',2,0,'',1),(0,319,195,NULL,NULL,'Japanese Sake-Yeast Beer','ezstring',921,'eng-GB',2,0,'japanese sake-yeast beer',1),(0,320,195,NULL,NULL,'A beer brewed with Sake yeast or Sake (koji) enzymes. Color depends on malts used. The unique flavor and aroma of the byproducts of sake yeast and/or koji enzymes should be distinctive and harmonize with the other malt and hop characters. Sake character may best be described as having mild fruitiness and a gentle and mild yeast extract-Vitamin B character. Hop bitterness, flavor and aroma should be low to medium and should harmonize with sake-like characters. High carbonation should be evident and a higher amount of alcohol may be evident. Body and mouth feel will vary depending on base style and original gravity. A slight chill haze is permissible. A very low amount of diacetyl may be perceived.','eztext',922,'eng-GB',2,0,'',1),(0,321,195,NULL,12,NULL,'ezinteger',923,'eng-GB',2,12,'',1),(0,322,195,NULL,35,NULL,'ezinteger',924,'eng-GB',2,35,'',1),(0,323,195,4,NULL,NULL,'ezfloat',925,'eng-GB',2,0,'',1),(0,324,195,7,NULL,NULL,'ezfloat',926,'eng-GB',2,0,'',1),(0,319,196,NULL,NULL,'Light American Wheat Ale or Lager with Yeast','ezstring',927,'eng-GB',2,0,'light american wheat ale or lager with yeast',1),(0,320,196,NULL,NULL,'This beer can be made using either ale or lager yeast. It can be brewed with 30 to 75 percent wheat malt, and hop rates may be low to medium. Hop characters may be light to moderate in bitterness, flavor and aroma. Fruity-estery aroma and flavor are typical but at low levels however, phenolic, clove-like characteristics should not be perceived. Color is usually straw to light amber, and the body should be light to medium in character. Diacetyl should not be perceived. Because this style is served with yeast the character should portray a full yeasty mouthfeel and appear hazy to very cloudy. Chill haze is also acceptable. Yeast flavor and aroma should be low to medium but not overpowering the balance and character of malt and hops. These beers are typically served with the yeast in the bottle, and are cloudy when served.','eztext',928,'eng-GB',2,0,'',1),(0,321,196,NULL,10,NULL,'ezinteger',929,'eng-GB',2,10,'',1),(0,322,196,NULL,35,NULL,'ezinteger',930,'eng-GB',2,35,'',1),(0,323,196,3,NULL,NULL,'ezfloat',931,'eng-GB',2,0,'',1),(0,324,196,5,NULL,NULL,'ezfloat',932,'eng-GB',2,0,'',1),(0,319,197,NULL,NULL,'Light American Wheat Ale or Lager without Yeast','ezstring',933,'eng-GB',2,0,'light american wheat ale or lager without yeast',1),(0,320,197,NULL,NULL,'This beer can be made using either ale or lager yeast. It can be brewed with 30 to 75 percent wheat malt, and hop rates may be low to medium. Hop characters may be light to moderate in bitterness, flavor and aroma. A fruity-estery aroma and flavor are typical but at low levels however, phenolic, clove-like characteristics should not be perceived. Appearance can be clear or with chill haze, golden to light amber, and the body should be light to medium in character. Diacetyl should not be perceived. Because this style is packaged and served without yeast, no yeast characters should be evident in mouthfeel, flavor, or aroma.','eztext',934,'eng-GB',2,0,'',1),(0,321,197,NULL,10,NULL,'ezinteger',935,'eng-GB',2,10,'',1),(0,322,197,NULL,35,NULL,'ezinteger',936,'eng-GB',2,35,'',1),(0,323,197,3,NULL,NULL,'ezfloat',937,'eng-GB',2,0,'',1),(0,324,197,5,NULL,NULL,'ezfloat',938,'eng-GB',2,0,'',1),(0,319,198,NULL,NULL,'Fruit Wheat Ale or Lager with or without Yeast','ezstring',939,'eng-GB',2,0,'fruit wheat ale or lager with or without yeast',1),(0,320,198,NULL,NULL,'This beer can be made using either ale or lager yeast. It can be brewed with 30 to 75 percent malted wheat. Fruit or fruit extracts contribute flavor and/or aroma. Perceived fruit qualities should be authentic and replicate true fruit complexity as much as possible. Color should reflect a degree of fruit\'s color. Hop rates may be low to medium. Hop characters may be light to moderate in bitterness, flavor and aroma. Fruity-estery aroma and flavor from yeast can be typical but at low levels; however, phenolic, clovelike characteristics should not be perceived. Body should be light to medium in character. Diacetyl should not be perceived. When this style is served with yeast the character should portray a full yeasty mouthfeel and appear hazy to very cloudy. Chill haze is also acceptable. Yeast flavor and aroma should be low to medium but not overpowering the balance and character of malt and hops. Brewer may indicate on the bottle whether the yeast should be intentionally roused or if they prefer that the entry be poured as quietly as possible.','eztext',940,'eng-GB',2,0,'',1),(0,321,198,NULL,10,NULL,'ezinteger',941,'eng-GB',2,10,'',1),(0,322,198,NULL,35,NULL,'ezinteger',942,'eng-GB',2,35,'',1),(0,323,198,3,NULL,NULL,'ezfloat',943,'eng-GB',2,0,'',1),(0,324,198,5,NULL,NULL,'ezfloat',944,'eng-GB',2,0,'',1),(0,319,199,NULL,NULL,'Dark American Wheat Ale or Lager with Yeast','ezstring',945,'eng-GB',2,0,'dark american wheat ale or lager with yeast',1),(0,320,199,NULL,NULL,'This beer can be made using either ale or lager yeast. It can be brewed with 30 to 75 percent malt wheat, and hop rates may be low to medium. Fruity-estery aroma and flavor are typical but at low levels; however, phenolic, clove-like characteristics should not be perceived. Color is dark amber to dark brown, and the body should be light to medium in character. Roasted malts are optionally evident in aroma and flavor with a low level of roast malt astringency acceptable when appropriately balanced with malt sweetness. Roast malts may be evident as a cocoa/chocolate or caramel character. Aromatic toffee-like, caramel, or biscuit-like characters may be part of the overall flavor/aroma profile. Diacetyl should not be perceived. Because this style is intended to be served with yeast the character should portray a full yeasty mouthfeel and appear hazy to very cloudy. Chill haze is acceptable. Yeast flavor and aroma should be low to medium but not overpowering the balance and character of malt and hops.','eztext',946,'eng-GB',2,0,'',1),(0,321,199,NULL,10,NULL,'ezinteger',947,'eng-GB',2,10,'',1),(0,322,199,NULL,25,NULL,'ezinteger',948,'eng-GB',2,25,'',1),(0,323,199,3,NULL,NULL,'ezfloat',949,'eng-GB',2,0,'',1),(0,324,199,5,NULL,NULL,'ezfloat',950,'eng-GB',2,0,'',1),(0,319,200,NULL,NULL,'Dark American Wheat Ale or Lager without Yeast','ezstring',951,'eng-GB',2,0,'dark american wheat ale or lager without yeast',1),(0,320,200,NULL,NULL,'This beer can be made using either ale or lager yeast. It can be brewed with 30 to 75 percent malted wheat, and hop rates may be low to medium. A fruity-estery aroma and flavor are typical but at low levels; however, phenolic, clove-like characteristics should not be perceived. Color is dark amber to dark brown, and the body should be light to medium in character. Roasted malts are optionally evident in aroma and flavor with a low level of roast malt astringency acceptable when appropriately balanced with malt sweetness. Roast malts may be evident as a cocoa/chocolate or caramel character. Aromatic toffee-like, caramel, or biscuit-like characters may be part of the overall flavor/aroma profile. Diacetyl should not be perceived. Because this style is packaged and served without yeast, no yeast characters should be evident in mouthfeel, flavor, or aroma. Chill haze is also acceptable.','eztext',952,'eng-GB',2,0,'',1),(0,321,200,NULL,10,NULL,'ezinteger',953,'eng-GB',2,10,'',1),(0,322,200,NULL,25,NULL,'ezinteger',954,'eng-GB',2,25,'',1),(0,323,200,3,NULL,NULL,'ezfloat',955,'eng-GB',2,0,'',1),(0,324,200,5,NULL,NULL,'ezfloat',956,'eng-GB',2,0,'',1),(0,319,201,NULL,NULL,'Rye Ale or Lager with or without Yeast','ezstring',957,'eng-GB',2,0,'rye ale or lager with or without yeast',1),(0,320,201,NULL,NULL,'Rye beers can be made using either ale or lager yeast. It should be brewed with at least 20 percent rye malt, and low to medium perception of hop bitterness. Hop aroma and flavor can be low to medium-high. These are often versions of classic styles that contain noticeable rye character in balance with other qualities of the beer. A spicy, fruity-estery aroma and flavor are typical but at low levels; however, phenolic, clove-like characteristics should not be perceived. Color is straw to amber, and the body should be light to medium in character. Diacetyl should not be perceived. If this style is packaged and served without yeast, no yeast characters should be evident in mouthfeel, flavor, or aroma. A low level of tannin derived astringency may be perceived. If this style is served with yeast, the character should portray a full yeasty mouthfeel and appear hazy to very cloudy. Yeast flavor and aroma should be low to medium but not overpowering the balance and character of rye and barley malt and hops. Darker versions of this style will be dark amber to dark brown, and the body should be light to medium in character. Roasted malts are optionally evident in aroma and flavor with a low level of roast malt astringency acceptable when appropriately balanced with malt sweetness. Roast malts may be evident as a cocoa/chocolate or caramel character. Aromatic toffee-like, caramel, or biscuit-like characters may be part of the overall flavor/aroma profile. As in the lighter colored versions, diacetyl should not be perceived. Competition directors may create specific styles of rye beer, such as Rye Pale Ale or Rye Brown Ale. A statement by the brewer indicating if the beer is based on a classic style is essential for accurate judging.','eztext',958,'eng-GB',2,0,'',1),(0,321,201,NULL,NULL,NULL,'ezinteger',959,'eng-GB',2,0,'',1),(0,322,201,NULL,NULL,NULL,'ezinteger',960,'eng-GB',2,0,'',1),(0,323,201,NULL,NULL,NULL,'ezfloat',961,'eng-GB',2,0,'',1),(0,324,201,NULL,NULL,NULL,'ezfloat',962,'eng-GB',2,0,'',1),(0,319,202,NULL,NULL,'German-Style Rye Ale (Roggenbier) with or without Yeast','ezstring',963,'eng-GB',2,0,'german-style rye ale (roggenbier) with or without yeast',1),(0,320,202,NULL,NULL,'This beer can be made using phenol producing ale yeast. It should be brewed with at least 30 percent rye malt, and hop rates will be low. A banana -like fruity-estery aroma and flavor are typical but at low levels; phenolic, clove-like characteristics should also be perceived. Color is straw to dark amber, and the body should be light to medium in character. Diacetyl should not be perceived. If this style is packaged and served without yeast, no yeast characters should be evident in mouthfeel, flavor, or aroma. If the beer is served with yeast, the character should portray a full yeasty mouthfeel and appear hazy to very cloudy. Yeast flavor and aroma should be low to medium but not overpowering the balance and character of rye and barley malt and hops. Darker versions of this style will be dark amber to dark brown, and the body should be light to medium in character. Roasted malts are optionally evident in aroma and flavor with a low level of roast malt astringency acceptable when appropriately balanced with malt sweetness. Roast malts may be evident as a cocoa/chocolate or light caramel character. Aromatic toffee-like, caramel, or biscuit-like characters may be part of the overall flavor/aroma profile. As in the lighter colored versions, diacetyl should not be perceived.','eztext',964,'eng-GB',2,0,'',1),(0,321,202,NULL,10,NULL,'ezinteger',965,'eng-GB',2,10,'',1),(0,322,202,NULL,15,NULL,'ezinteger',966,'eng-GB',2,15,'',1),(0,323,202,4,NULL,NULL,'ezfloat',967,'eng-GB',2,0,'',1),(0,324,202,5,NULL,NULL,'ezfloat',968,'eng-GB',2,0,'',1),(0,319,203,NULL,NULL,'Fruit Beer','ezstring',969,'eng-GB',2,0,'fruit beer',1),(0,320,203,NULL,NULL,'Fruit beers are any beers using fruit or fruit extracts as an adjunct in either, the mash, kettle, primary or secondary fermentation providing obvious (ranging from subtle to intense), yet harmonious, fruit qualities. Fruit qualities should not be overpowered by hop character. If a fruit (such as juniper berry) has an herbal or spice quality, it is more appropriate to consider it in the herb and spice beers category. Acidic bacterial (not wild yeast) fermentation characters may be evident (but not necessary) they would contribute to acidity and enhance fruity balance. Clear or hazy beer is acceptable in appearance. A statement by the brewer explaining what fruits are used is essential in order for fair assessment in competitions. If this beer is a classic style with fruit, the brewer should also specify the classic style.','eztext',970,'eng-GB',2,0,'',1),(0,321,203,NULL,5,NULL,'ezinteger',971,'eng-GB',2,5,'',1),(0,322,203,NULL,70,NULL,'ezinteger',972,'eng-GB',2,70,'',1),(0,323,203,2,NULL,NULL,'ezfloat',973,'eng-GB',2,0,'',1),(0,324,203,12,NULL,NULL,'ezfloat',974,'eng-GB',2,0,'',1),(0,319,204,NULL,NULL,'Field Beer','ezstring',975,'eng-GB',2,0,'field beer',1),(0,320,204,NULL,NULL,'Field beers are any beers using vegetables as an adjunct in either the mash, kettle, primary or secondary fermentation, providing obvious (ranging from subtle to intense), yet harmonious, qualities. Vegetable qualities should not be overpowered by hop character. If a vegetable has an herbal or spice quality (such as the \"heat\" of a chili pepper), it should be classified as herb/spice beer style.  Note Chili-flavored beer with notable roast or vegetal character is evident it should be entered as Field Beer.  A statement by the brewer explaining what vegetables are used is essential in order for fair assessment in competitions. If this beer is a classic style with vegetables, the brewer should also specify the classic style. Note: If no Pumpkin beer category exists in a competition, then Pumpkin beers should be entered in this category.','eztext',976,'eng-GB',2,0,'',1),(0,321,204,NULL,5,NULL,'ezinteger',977,'eng-GB',2,5,'',1),(0,322,204,NULL,70,NULL,'ezinteger',978,'eng-GB',2,70,'',1),(0,323,204,2,NULL,NULL,'ezfloat',979,'eng-GB',2,0,'',1),(0,324,204,13,NULL,NULL,'ezfloat',980,'eng-GB',2,0,'',1),(0,319,205,NULL,NULL,'Pumpkin Beer','ezstring',981,'eng-GB',2,0,'pumpkin beer',1),(0,320,205,NULL,NULL,'Pumpkin beers are any beers using pumpkins (Cucurbito pepo) as an adjunct in either mash, kettle, primary or secondary fermentation, providing obvious (ranging from subtle to intense), yet harmonious, qualities. Pumpkin qualities should not be overpowered by hop character. These may or may not be spiced or flavored with other things. A statement by the brewer explaining the nature of the beer is essential for fair assessment in competitions. If this beer is a classic style with pumpkin, the brewer should also specify the classic style.','eztext',982,'eng-GB',2,0,'',1),(0,321,205,NULL,5,NULL,'ezinteger',983,'eng-GB',2,5,'',1),(0,322,205,NULL,70,NULL,'ezinteger',984,'eng-GB',2,70,'',1),(0,323,205,2,NULL,NULL,'ezfloat',985,'eng-GB',2,0,'',1),(0,324,205,12,NULL,NULL,'ezfloat',986,'eng-GB',2,0,'',1),(0,319,206,NULL,NULL,'Chocolate / Cocoa-Flavored Beer','ezstring',987,'eng-GB',2,0,'chocolate / cocoa-flavored beer',1),(0,320,206,NULL,NULL,'Chocolate beers use \"dark\" chocolate or cocoa in any of its forms other than or in addition to hops to create a distinct (ranging from subtle to intense) character. Under hopping allows chocolate to contribute to the flavor profile while not becoming excessively bitter. White Chocolate should not be entered into this category. If this beer is a classic style with chocolate or cocoa, the brewer should specify the classic style.','eztext',988,'eng-GB',2,0,'',1),(0,321,206,NULL,15,NULL,'ezinteger',989,'eng-GB',2,15,'',1),(0,322,206,NULL,40,NULL,'ezinteger',990,'eng-GB',2,40,'',1),(0,323,206,2,NULL,NULL,'ezfloat',991,'eng-GB',2,0,'',1),(0,324,206,12,NULL,NULL,'ezfloat',992,'eng-GB',2,0,'',1),(0,319,207,NULL,NULL,'Coffee-Flavored Beer','ezstring',993,'eng-GB',2,0,'coffee-flavored beer',1),(0,320,207,NULL,NULL,'Coffee beers use coffee in any of its forms other than or in addition to hops to create a distinct (ranging from subtle to intense) character. Under hopping allows coffee to contribute to the flavor profile while not becoming excessively bitter. If this beer is a classic style with coffee flavor, the brewer should specify the classic style.','eztext',994,'eng-GB',2,0,'',1),(0,321,207,NULL,15,NULL,'ezinteger',995,'eng-GB',2,15,'',1),(0,322,207,NULL,40,NULL,'ezinteger',996,'eng-GB',2,40,'',1),(0,323,207,2,NULL,NULL,'ezfloat',997,'eng-GB',2,0,'',1),(0,324,207,12,NULL,NULL,'ezfloat',998,'eng-GB',2,0,'',1),(0,319,208,NULL,NULL,'Herb and Spice Beer','ezstring',999,'eng-GB',2,0,'herb and spice beer',1),(0,320,208,NULL,NULL,'Herb beers use herbs or spices (derived from roots, seeds, fruits, vegetable, flowers, etc.) other than or in addition to hops to create a distinct (ranging from subtle to intense) character, though individual characters of herbs and/or spices used may not always be identifiable. Under hopping often, but not always, allows the spice or herb to contribute to the flavor profile. Positive evaluations are significantly based on perceived balance of flavors. Note: Chili-flavored beers that emphasize heat rather than chili flavor should be entered as a \"spiced\" beer.  A statement by the brewer explaining what herbs or spices are used is essential in order for fair assessment in competitions. Specifying a style upon which the beer is based may help evaluation. If this beer is a classic style with an herb or spice, the brewer should specify the classic style. If no Chocolate or Coffee category exists in a competition, then chocolate and coffee beers should be entered in this category.','eztext',1000,'eng-GB',2,0,'',1),(0,321,208,NULL,5,NULL,'ezinteger',1001,'eng-GB',2,5,'',1),(0,322,208,NULL,70,NULL,'ezinteger',1002,'eng-GB',2,70,'',1),(0,323,208,2,NULL,NULL,'ezfloat',1003,'eng-GB',2,0,'',1),(0,324,208,12,NULL,NULL,'ezfloat',1004,'eng-GB',2,0,'',1),(0,319,209,NULL,NULL,'Specialty Beer','ezstring',1005,'eng-GB',2,0,'specialty beer',1),(0,320,209,NULL,NULL,'These beers are brewed using unusual fermentable sugars, grains and starches that contribute to alcohol content other than, or in addition to, malted barley. Nuts generally have some degree of fermentables, thus beers brewed with nuts would appropriately be entered in this category. The distinctive characters of these special ingredients should be evident either in the aroma, flavor or overall balance of the beer, but not necessarily in overpowering quantities. For example, maple syrup or potatoes would be considered unusual. Rice, corn, or wheat are not considered unusual. Special ingredients must be listed when competing. A statement by the brewer explaining the special nature of the beer, ingredient(s) and achieved character is essential in order for fair assessment in competitions. If this beer is a classic style with some specialty ingredient(s), the brewer should also specify the classic style. Guidelines for competing: Spiced beers using unusual fermentables should be entered in the experimental category. Fruit beers using unusual fermentables should be entered in the fruit beer category.','eztext',1006,'eng-GB',2,0,'',1),(0,321,209,NULL,NULL,NULL,'ezinteger',1007,'eng-GB',2,0,'',1),(0,322,209,NULL,100,NULL,'ezinteger',1008,'eng-GB',2,100,'',1),(0,323,209,2,NULL,NULL,'ezfloat',1009,'eng-GB',2,0,'',1),(0,324,209,25,NULL,NULL,'ezfloat',1010,'eng-GB',2,0,'',1),(0,319,210,NULL,NULL,'Specialty Honey Lager or Ale','ezstring',1011,'eng-GB',2,0,'specialty honey lager or ale',1),(0,320,210,NULL,NULL,'These beers are brewed using honey in addition to malted barley. Beers may be brewed to a traditional style or may be experimental. Character of honey should be evident in flavor and aroma and balanced with the other components without overpowering them. A statement by the brewer explaining the classic or other style of the beer, and the type of honey used is essential in order for fair assessment in competitions.','eztext',1012,'eng-GB',2,0,'',1),(0,321,210,NULL,NULL,NULL,'ezinteger',1013,'eng-GB',2,0,'',1),(0,322,210,NULL,100,NULL,'ezinteger',1014,'eng-GB',2,100,'',1),(0,323,210,2,NULL,NULL,'ezfloat',1015,'eng-GB',2,0,'',1),(0,324,210,12,NULL,NULL,'ezfloat',1016,'eng-GB',2,0,'',1),(0,319,211,NULL,NULL,'Gluten-Free Beer','ezstring',1017,'eng-GB',2,0,'gluten-free beer',1),(0,320,211,NULL,NULL,'A beer (lager, ale or other) that is made from fermentable sugars, grains and converted carbohydrates. Ingredients do not contain gluten, in other words zero gluten (No barley, wheat, spelt, oats, rye, etc). May or may not contain malted grains that do not contain gluten. Brewers may or may not design and identify these beers along other style guidelines with regard to flavor, aroma and appearance profile. The beer\'s overall balance and character should be based on its own merits and not necessarily compared with traditional styles of beer. In competitions, brewers identify ingredients and fermentation type. NOTE: These guidelines do not supersede any government regulations. Wine, mead, flavored malt beverages or beverages other than beer as defined by the TTB (U.S. Trade and Tax Bureau) are not considered \"gluten-free beer\" under these guidelines.','eztext',1018,'eng-GB',2,0,'',1),(0,321,211,NULL,NULL,NULL,'ezinteger',1019,'eng-GB',2,0,'',1),(0,322,211,NULL,NULL,NULL,'ezinteger',1020,'eng-GB',2,0,'',1),(0,323,211,NULL,NULL,NULL,'ezfloat',1021,'eng-GB',2,0,'',1),(0,324,211,NULL,NULL,NULL,'ezfloat',1022,'eng-GB',2,0,'',1),(0,319,212,NULL,NULL,'Indigenous Beer (Lager or Ale)','ezstring',1023,'eng-GB',2,0,'indigenous beer (lager or ale)',1),(0,320,212,NULL,NULL,'This beer style is unusual in that its impetus is to commemorate combinations of ingredients and/or techniques adopted by or unique to a particular region. At least one regional combination of ingredients and/or techniques must be unique and differentiated from ingredients and/or techniques commonly used by brewers throughout the world.  There are many excellent and popular beers that are brewed with either non-traditional or traditional ingredients and/or processes yet their character may distinctively vary from all other styles currently defined or included in these guidelines. These grain-based beers are brewed reflecting local beer culture (process, ingredients, climate, etc.). This category recognizes uniquely local or regional beer types and beers distinctively not defined in any recognized style in these guidelines. They may be light or dark, strong or weak, hoppy or not hoppy. They may have characters which are unique to yeast, fermentation techniques, aging conditions, carbonation level - or higher or lower levels of profound characters normally associated with other beer types. Examples of indigenous beers might include current day versions of highly regional and/or historic styles which are not represented elsewhere in these guidelines, such as Finnish-style sahti, S American chicha, African sorghum based beers, and others. Other examples might include beers made wholly unique by use of multiple local ingredients and/or techniques, with the resulting beer being highly representative of location, as well as differentiated from traditional beer style categories. Beers brewed with non-traditional hop varieties, grains, malt, yeast or other ingredient that still closely approximate an existing classical category would be more appropriately entered into the classical category. New and innovative beers that do not represent locally adopted techniques or grown ingredients would be more appropriately entered into the experimental category. Proper evaluation of entries in this category requires the need to provide  judges with additional information about the beer.  A written summary illustrating the intent, background, history, design and/or development of the beer as well as  describing any regional and/or stylistic context, choice of ingredients, process and any other unique information, helps establish a basis for comparison between highly diverse entries. Entering brewers must provide a statement of 100 words or less illustrating the above and why it is an indigenous beer without revealing the company\'s identity. This statement should be carefully crafted and will be evaluated by judges and carry significant weight in their decisions. Statements that contain information which might identify or otherwise create bias towards the entry will be modified by the Competition Manager. Entries not accompanied by this information will be at a profound disadvantage during judging.','eztext',1024,'eng-GB',2,0,'',1),(0,321,212,NULL,NULL,NULL,'ezinteger',1025,'eng-GB',2,0,'',1),(0,322,212,NULL,NULL,NULL,'ezinteger',1026,'eng-GB',2,0,'',1),(0,323,212,NULL,NULL,NULL,'ezfloat',1027,'eng-GB',2,0,'',1),(0,324,212,NULL,NULL,NULL,'ezfloat',1028,'eng-GB',2,0,'',1),(0,319,213,NULL,NULL,'Smoke Beer (Lager or Ale)','ezstring',1029,'eng-GB',2,0,'smoke beer (lager or ale)',1),(0,320,213,NULL,NULL,'Any style of beer can be smoked; the goal is to reach a balance between the style\'s character and the smoky properties. Type of wood or other sources of smoke should be specified as well as the style the beer is based upon.','eztext',1030,'eng-GB',2,0,'',1),(0,321,213,NULL,NULL,NULL,'ezinteger',1031,'eng-GB',2,0,'',1),(0,322,213,NULL,NULL,NULL,'ezinteger',1032,'eng-GB',2,0,'',1),(0,323,213,NULL,NULL,NULL,'ezfloat',1033,'eng-GB',2,0,'',1),(0,324,213,NULL,NULL,NULL,'ezfloat',1034,'eng-GB',2,0,'',1),(0,319,214,NULL,NULL,'Experimental Beer (Lager or Ale)','ezstring',1035,'eng-GB',2,0,'experimental beer (lager or ale)',1),(0,320,214,NULL,NULL,'An experimental beer is any beer (lager, ale or other) that is primarily grain-based and employs unusual techniques and/or ingredients. A minimum 51% of the fermentable carbohydrates must be derived from malted grains. The overall uniqueness of the process, ingredients used and creativity should be considered. Beers such as garden (vegetable), fruit, chocolate, coffee, spice, specialty or other beers that match existing categories should not be entered into this category. Beers not easily matched to existing style categories in a competition would often be entered into this category. Beers that are a combination of other categories (spice, smoke, specialty, porter, etc.) could also be entered into this category. A statement by the brewer explaining the experimental or other nature of the beer is essential in order for fair assessment in competitions. Generally, a 25-word statement would suffice in explaining the experimental nature of the beer.','eztext',1036,'eng-GB',2,0,'',1),(0,321,214,NULL,NULL,NULL,'ezinteger',1037,'eng-GB',2,0,'',1),(0,322,214,NULL,NULL,NULL,'ezinteger',1038,'eng-GB',2,0,'',1),(0,323,214,NULL,NULL,NULL,'ezfloat',1039,'eng-GB',2,0,'',1),(0,324,214,NULL,NULL,NULL,'ezfloat',1040,'eng-GB',2,0,'',1),(0,319,215,NULL,NULL,'Out of Category - Traditionally Brewed Beer','ezstring',1041,'eng-GB',2,0,'out of category - traditionally brewed beer',1),(0,320,215,NULL,NULL,'There are many excellent and popular beers that are brewed with predominantly traditional ingredients and processes yet their character may distinctively vary from styles currently defined or included in these guidelines. For example a brewer may formulate a dark stout but may use lager yeast rather than ale yeast and dry hop with hops more typically used for German-style pilsener. Or perhaps a beer falls distinctively out of the color, alcohol or bitterness range of defined styles. This category recognizes distinctively undefined beers. They may be light or dark, strong or weak, hoppy or not hoppy. Beers brewed with non-traditional hops, malt, yeast or other ingredient that still closely approximate an existing classical category should be entered into the classical category. A short statement by the brewer whether explanatory or poetic often accompanies these beers. For competition purposes, these beers could be grouped as a subcategory of experimental beers','eztext',1042,'eng-GB',2,0,'',1),(0,321,215,NULL,NULL,NULL,'ezinteger',1043,'eng-GB',2,0,'',1),(0,322,215,NULL,NULL,NULL,'ezinteger',1044,'eng-GB',2,0,'',1),(0,323,215,NULL,NULL,NULL,'ezfloat',1045,'eng-GB',2,0,'',1),(0,324,215,NULL,NULL,NULL,'ezfloat',1046,'eng-GB',2,0,'',1),(0,319,216,NULL,NULL,'Wood- and Barrel-Aged Beer','ezstring',1047,'eng-GB',2,0,'wood- and barrel-aged beer',1),(0,320,216,NULL,NULL,'A wood- or barrel-aged beer is any lager, ale or hybrid beer, either a traditional style or a unique experimental beer that has been aged for a period of time in a wooden barrel or in contact with wood. This beer is aged with the intention of imparting the particularly unique character of the wood and/or what has previously been in the barrel. New wood character can be characterized as a complex blend of vanillin and/or other unique wood character, but wood aged is not necessarily synonymous with imparting wood-flavors. Used sherry, rum, bourbon, scotch, port, wine and other barrels are often used, imparting complexity and uniqueness to beer. Ultimately a balance of flavor, aroma and mouthfeel are sought with the marriage of new beer with wood and/or barrel flavors. Beers in this style may or may not have Brettanomyces character. Brewers when entering this category should specify type of barrel and/or wood used and any other special treatment or ingredients used. Competition managers may create style subcategories to differentiate between high alcohol and low alcohol beers and very dark and lighter colored beer as well as for fruit beers and non-fruit beers. Competitions may develop guidelines requesting brewers to specify what kind of wood (new or used oak, other wood varieties) and/or barrel (whiskey, port, sherry, wine, etc.) was used in the process. The brewer may be asked to explain the special nature (wood used, base beer style(s) and achieved character) of the beer.','eztext',1048,'eng-GB',2,0,'',1),(0,321,216,NULL,NULL,NULL,'ezinteger',1049,'eng-GB',2,0,'',1),(0,322,216,NULL,NULL,NULL,'ezinteger',1050,'eng-GB',2,0,'',1),(0,323,216,NULL,NULL,NULL,'ezfloat',1051,'eng-GB',2,0,'',1),(0,324,216,NULL,NULL,NULL,'ezfloat',1052,'eng-GB',2,0,'',1),(0,319,217,NULL,NULL,'Wood- and Barrel-Aged Pale to Amber Beer','ezstring',1053,'eng-GB',2,0,'wood- and barrel-aged pale to amber beer',1),(0,320,217,NULL,NULL,'Any classic style or unique experimental beer that has been aged for a period of time in a wooden barrel or in contact with wood. This beer is aged with the intention of imparting the particularly unique character of the wood and/or what has previously been in the barrel. New wood character can be characterized as a complex blend of vanillin and/or other unique wood character but wood aged is not necessarily synonymous with imparting wood-flavors. Used sherry, rum, bourbon, scotch, port, wine and other barrels are often used, imparting complexity and uniqueness to beer. Ultimately a balance of flavor, aroma and mouthfeel are sought with the marriage of new beer with wood and/or barrel flavors. Primary character of the beer style may or may not be apparent. Sour wood-aged beer of any color is outlined in other categories. Fruited or spiced beer that is wood and barrel aged would also be appropriately entered in this category. Beers in this style may or may not have Brettanomyces character.  The brewer should explain the special nature of the beer to allow for accurate judging. Comments could include: type of wood used (new or old, oak or other wood type), type of barrel used (new, port/ whiskey/ wine/ sherry/ other), base beer style or achieved character. Beer entries not accompanied by this information will be at a disadvantage during judging.','eztext',1054,'eng-GB',2,0,'',1),(0,321,217,NULL,NULL,NULL,'ezinteger',1055,'eng-GB',2,0,'',1),(0,322,217,NULL,NULL,NULL,'ezinteger',1056,'eng-GB',2,0,'',1),(0,323,217,3,NULL,NULL,'ezfloat',1057,'eng-GB',2,0,'',1),(0,324,217,6,NULL,NULL,'ezfloat',1058,'eng-GB',2,0,'',1),(0,319,218,NULL,NULL,'Wood- and Barrel-Aged Dark Beer','ezstring',1059,'eng-GB',2,0,'wood- and barrel-aged dark beer',1),(0,320,218,NULL,NULL,'Any classic style or unique experimental style of dark beer can be wood or barrel-aged for a period of time in a wooden barrel or in contact with wood. This beer is aged with the intention of imparting the particularly unique character of the wood and/or what has previously been in the barrel. New wood character can be characterized as a complex blend of vanillin and/or other unique wood character but wood-aged is not necessarily synonymous with imparting wood-flavors. Used sherry, rum, bourbon, scotch, port, wine and other barrels are often used, imparting complexity and uniqueness to beer. Ultimately a balance of flavor, aroma and mouthfeel are sought with the marriage of new beer with wood and/or barrel flavors. Primary character of the beer style may or may not be apparent. Sour wood-aged beer of any color is outlined in other categories. Dark fruited or spiced beer would also be appropriately entered in this category. Beers in this style may or may not have Brettanomyces character.  The brewer should explain the special nature of the beer to allow for accurate judging. Comments could include: type of wood used (new or old, oak or other wood type), type of barrel used (new, port/ whiskey/ wine/ sherry/ other), base beer style or achieved character. Beer entries not accompanied by this information will be at a disadvantage during judging.','eztext',1060,'eng-GB',2,0,'',1),(0,321,218,NULL,NULL,NULL,'ezinteger',1061,'eng-GB',2,0,'',1),(0,322,218,NULL,NULL,NULL,'ezinteger',1062,'eng-GB',2,0,'',1),(0,323,218,3,NULL,NULL,'ezfloat',1063,'eng-GB',2,0,'',1),(0,324,218,6,NULL,NULL,'ezfloat',1064,'eng-GB',2,0,'',1),(0,319,219,NULL,NULL,'Wood- and Barrel-Aged Strong Beer','ezstring',1065,'eng-GB',2,0,'wood- and barrel-aged strong beer',1),(0,320,219,NULL,NULL,'Any strong classic style or unique, experimental style of beer can be wood or barrel-aged for a period of time in a wooden barrel or in contact with wood. This beer is aged with the intention of imparting the particularly unique character of the wood and/or what has previously been in the barrel. New wood character can be characterized as a complex blend of vanillin and unique wood character but wood aged is not necessarily synonymous with imparting wood-flavors. Used sherry, rum, bourbon, scotch, port, wine and other barrels are often used, imparting complexity and uniqueness to beer. Ultimately a balance of flavor, aroma and mouthfeel are sought with the marriage of new beer with wood and/or barrel flavors. Primary character of the beer style may or may not be apparent. Sour wood-aged beer of any color is outlined in other categories. Beers in this style may or may not have Brettanomyces character. The brewer must explain the special nature of the beer to allow for accurate judging. Comments could include: type of wood used (new or old, oak or other wood type), type of barrel used (new, port/ whiskey/ wine/ sherry/ other), base beer style or achieved character. Beer entries not accompanied by this information will be at a disadvantage during judging.','eztext',1066,'eng-GB',2,0,'',1),(0,321,219,NULL,NULL,NULL,'ezinteger',1067,'eng-GB',2,0,'',1),(0,322,219,NULL,NULL,NULL,'ezinteger',1068,'eng-GB',2,0,'',1),(0,323,219,NULL,NULL,NULL,'ezfloat',1069,'eng-GB',2,0,'',1),(0,324,219,NULL,NULL,NULL,'ezfloat',1070,'eng-GB',2,0,'',1),(0,319,220,NULL,NULL,'Wood- and Barrel-Aged Sour Beer','ezstring',1071,'eng-GB',2,0,'wood- and barrel-aged sour beer',1),(0,320,220,NULL,NULL,'A wood- or barrel-aged sour beer is any lager, ale or hybrid beer, either a traditional style or a unique experimental beer that has been aged for a period of time in a wooden barrel or in contact with wood and has developed a bacterial induced natural acidity. This beer is aged in wood with the intention of introducing the micro flora present in the wood. Sometimes wood aging is intended to impart the particularly unique character of the wood, but wood-aged is not necessarily synonymous with imparting wood-flavors. Wood character can be characterized as a complex blend of vanillin and unique wood character. Wood-derived character can also be characterized by flavors of the product that was in the barrel during prior use. These wood-derived flavors, if present in this style, can be very low in character and barely perceived or evident or assertive as wood-derived flavors. Any degree of woodderived flavors should be in balance with other beer character. Fruit and herb/spiced versions may take on the hue, flavors and aromas of added ingredients.  Usually bacteria and \"wild\" yeasts fermentation contributes complex esters and results in a dry to very dry beer. Ultimately a balance of flavor, aroma and mouthfeel are sought with the marriage of acidity, complex esters, and new beer with wood and/or barrel flavors. Beers in this style may or may not have Brettanomyces character.  Brewers when entering this category should specify type of barrel used and any other special treatment or ingredients used. Competition managers may create style subcategories to differentiate between high alcohol and low alcohol beers and very dark and lighter colored beer as well as for fruit beers and non-fruit beers. Competitions may develop guidelines requesting brewers to specify what kind of wood (new or used oak, other wood varieties). The brewer may be asked to explain the special nature (wood used, base beer style(s) and achieved character) of the beer.','eztext',1072,'eng-GB',2,0,'',1),(0,321,220,NULL,NULL,NULL,'ezinteger',1073,'eng-GB',2,0,'',1),(0,322,220,NULL,NULL,NULL,'ezinteger',1074,'eng-GB',2,0,'',1),(0,323,220,NULL,NULL,NULL,'ezfloat',1075,'eng-GB',2,0,'',1),(0,324,220,NULL,NULL,NULL,'ezfloat',1076,'eng-GB',2,0,'',1),(0,319,221,NULL,NULL,'Aged Beer (Ale or Lager)','ezstring',1077,'eng-GB',2,0,'aged beer (ale or lager)',1),(0,320,221,NULL,NULL,'Beers aged for over one year. Generally beers with high hopping rates, roast malt content, high alcohol content, complex herbal, smoke or fruit content (Wood aging, Brettanomyces characters and acidic beers must be classified or entered into other categories if that option is available), A brewer may brew any type of beer of any strength and enhance its character with extended and creative aging conditions. Beers in this category may be aged in bottles or any type of food grade vessel. In competition brewers may be required to state age of beer. Competition organizer may develop guidelines in which aged beers are subcategorized by aging time, vessel, styles, etc. Brewers should provide a statement describing the nature or style of the beer. This statement could include classic or other style, special ingredients, length of aging time, etc.','eztext',1078,'eng-GB',2,0,'',1),(0,321,221,NULL,NULL,NULL,'ezinteger',1079,'eng-GB',2,0,'',1),(0,322,221,NULL,NULL,NULL,'ezinteger',1080,'eng-GB',2,0,'',1),(0,323,221,NULL,NULL,NULL,'ezfloat',1081,'eng-GB',2,0,'',1),(0,324,221,NULL,NULL,NULL,'ezfloat',1082,'eng-GB',2,0,'',1),(0,319,222,NULL,NULL,'Other Strong Ale or Lager','ezstring',1083,'eng-GB',2,0,'other strong ale or lager',1),(0,320,222,NULL,NULL,'Any style of beer can be made stronger than the classic style guidelines. The goal should be to reach a balance between the style\'s character and the additional alcohol. Refer to this guide when making styles stronger and appropriately identify the style created (for example: double alt, triple fest, or quadruple Pilsener).','eztext',1084,'eng-GB',2,0,'',1),(0,321,222,NULL,NULL,NULL,'ezinteger',1085,'eng-GB',2,0,'',1),(0,322,222,NULL,NULL,NULL,'ezinteger',1086,'eng-GB',2,0,'',1),(0,323,222,NULL,NULL,NULL,'ezfloat',1087,'eng-GB',2,0,'',1),(0,324,222,NULL,NULL,NULL,'ezfloat',1088,'eng-GB',2,0,'',1),(0,319,223,NULL,NULL,'Non-Alcoholic (Beer) Malt Beverages','ezstring',1089,'eng-GB',2,0,'non-alcoholic (beer) malt beverages',1),(0,320,223,NULL,NULL,'Non-alcoholic (NA) malt beverages should emulate the character of a previously listed category/subcategory designation but without the alcohol (less than 0.5 percent). Non-alcoholic (beer) malt beverages will inherently have a profile lacking the complexity and balance of flavors which can be attributed to alcohol. They should accordingly not be assessed negatively for reasons related to the absence of alcohol.','eztext',1090,'eng-GB',2,0,'',1),(0,321,223,NULL,NULL,NULL,'ezinteger',1091,'eng-GB',2,0,'',1),(0,322,223,NULL,NULL,NULL,'ezinteger',1092,'eng-GB',2,0,'',1),(0,323,223,NULL,NULL,NULL,'ezfloat',1093,'eng-GB',2,0,'',1),(0,324,223,NULL,NULL,NULL,'ezfloat',1094,'eng-GB',2,0,'',1),(0,318,224,NULL,NULL,'Mead, Cider, & Perry','ezstring',1095,'eng-GB',2,0,'mead, cider, & perry',1),(0,319,225,NULL,NULL,'Dry Mead','ezstring',1096,'eng-GB',2,0,'dry mead',1),(0,320,225,NULL,NULL,'Similar in balance, body, finish and flavor intensity to a dry white wine, with a pleasant mixture of subtle honey character, soft fruity esters, and clean alcohol. Complexity, harmony, and balance of sensory elements are most desirable, with no inconsistencies in color, aroma, flavor or aftertaste. The proper balance of sweetness, acidity, alcohol and honey character is the essential final measure of any mead.','eztext',1097,'eng-GB',2,0,'',1),(0,321,225,NULL,NULL,NULL,'ezinteger',1098,'eng-GB',2,0,'',1),(0,322,225,NULL,NULL,NULL,'ezinteger',1099,'eng-GB',2,0,'',1),(0,323,225,NULL,NULL,NULL,'ezfloat',1100,'eng-GB',2,0,'',1),(0,324,225,NULL,NULL,NULL,'ezfloat',1101,'eng-GB',2,0,'',1),(0,319,226,NULL,NULL,'Semi-Sweet Mead','ezstring',1102,'eng-GB',2,0,'semi-sweet mead',1),(0,320,226,NULL,NULL,'Similar in balance, body, finish and flavor intensity to a semisweet (or medium-dry) white wine, with a pleasant mixture of honey character, light sweetness, soft fruity esters, and clean alcohol. Complexity, harmony, and balance of sensory elements are most desirable, with no inconsistencies in color, aroma, flavor or aftertaste. The proper balance of sweetness, acidity, alcohol and honey character is the essential final measure of any mead.','eztext',1103,'eng-GB',2,0,'',1),(0,321,226,NULL,NULL,NULL,'ezinteger',1104,'eng-GB',2,0,'',1),(0,322,226,NULL,NULL,NULL,'ezinteger',1105,'eng-GB',2,0,'',1),(0,323,226,NULL,NULL,NULL,'ezfloat',1106,'eng-GB',2,0,'',1),(0,324,226,NULL,NULL,NULL,'ezfloat',1107,'eng-GB',2,0,'',1),(0,319,227,NULL,NULL,'Sweet Mead','ezstring',1108,'eng-GB',2,0,'sweet mead',1),(0,320,227,NULL,NULL,'Similar in balance, body, finish and flavor intensity to a well-made dessert wine (such as Sauternes), with a pleasant mixture of honey character, residual sweetness, soft fruity esters, and clean alcohol. Complexity, harmony, and balance of sensory elements are most desirable, with no inconsistencies in color, aroma, flavor or aftertaste. The proper balance of sweetness, acidity, alcohol and honey character is the essential final measure of any mead.','eztext',1109,'eng-GB',2,0,'',1),(0,321,227,NULL,NULL,NULL,'ezinteger',1110,'eng-GB',2,0,'',1),(0,322,227,NULL,NULL,NULL,'ezinteger',1111,'eng-GB',2,0,'',1),(0,323,227,NULL,NULL,NULL,'ezfloat',1112,'eng-GB',2,0,'',1),(0,324,227,NULL,NULL,NULL,'ezfloat',1113,'eng-GB',2,0,'',1),(0,319,228,NULL,NULL,'Cyser (Apple Melomel)','ezstring',1114,'eng-GB',2,0,'cyser (apple melomel)',1),(0,320,228,NULL,NULL,'In well-made examples of the style, the fruit is both distinctive and well-incorporated into the honey-sweet-acid-tannin-alcohol balance of the mead. Some of the best strong examples have the taste and aroma of an aged Calvados (apple brandy from northern France), while subtle, dry versions can taste similar to many fine white wines.','eztext',1115,'eng-GB',2,0,'',1),(0,321,228,NULL,NULL,NULL,'ezinteger',1116,'eng-GB',2,0,'',1),(0,322,228,NULL,NULL,NULL,'ezinteger',1117,'eng-GB',2,0,'',1),(0,323,228,NULL,NULL,NULL,'ezfloat',1118,'eng-GB',2,0,'',1),(0,324,228,NULL,NULL,NULL,'ezfloat',1119,'eng-GB',2,0,'',1),(0,319,229,NULL,NULL,'Pyment (Grape Melomel)','ezstring',1120,'eng-GB',2,0,'pyment (grape melomel)',1),(0,320,229,NULL,NULL,'In well-made examples of the style, the grape is both distinctively vinous and well-incorporated into the honey-sweet-acid-tannin-alcohol balance of the mead. White and red versions can be quite different, and the overall impression should be characteristic of the type of grapes used and suggestive of a similar variety wine.','eztext',1121,'eng-GB',2,0,'',1),(0,321,229,NULL,NULL,NULL,'ezinteger',1122,'eng-GB',2,0,'',1),(0,322,229,NULL,NULL,NULL,'ezinteger',1123,'eng-GB',2,0,'',1),(0,323,229,NULL,NULL,NULL,'ezfloat',1124,'eng-GB',2,0,'',1),(0,324,229,NULL,NULL,NULL,'ezfloat',1125,'eng-GB',2,0,'',1),(0,319,230,NULL,NULL,'Other Fruit Melomel','ezstring',1126,'eng-GB',2,0,'other fruit melomel',1),(0,320,230,NULL,NULL,'In well-made examples of the style, the fruit is both distinctive and well-incorporated into the honey-sweet-acid-tannin-alcohol balance of the mead. Different types of fruit can result in widely different characteristics; allow for a variation in the final product.','eztext',1127,'eng-GB',2,0,'',1),(0,321,230,NULL,NULL,NULL,'ezinteger',1128,'eng-GB',2,0,'',1),(0,322,230,NULL,NULL,NULL,'ezinteger',1129,'eng-GB',2,0,'',1),(0,323,230,NULL,NULL,NULL,'ezfloat',1130,'eng-GB',2,0,'',1),(0,324,230,NULL,NULL,NULL,'ezfloat',1131,'eng-GB',2,0,'',1),(0,319,231,NULL,NULL,'Metheglin','ezstring',1132,'eng-GB',2,0,'metheglin',1),(0,320,231,NULL,NULL,'In well-made examples of the style, the herbs/spices are both distinctive and well-incorporated into the honey-sweet-acid-tannin-alcohol balance of the mead. Different types of herbs/spices can result in widely different characteristics; allow for a variation in the final product.','eztext',1133,'eng-GB',2,0,'',1),(0,321,231,NULL,NULL,NULL,'ezinteger',1134,'eng-GB',2,0,'',1),(0,322,231,NULL,NULL,NULL,'ezinteger',1135,'eng-GB',2,0,'',1),(0,323,231,NULL,NULL,NULL,'ezfloat',1136,'eng-GB',2,0,'',1),(0,324,231,NULL,NULL,NULL,'ezfloat',1137,'eng-GB',2,0,'',1),(0,319,232,NULL,NULL,'Braggot','ezstring',1138,'eng-GB',2,0,'braggot',1),(0,320,232,NULL,NULL,'A harmonious blend of mead and beer, with the distinctive characteristics of both. A wide range of results are possible, depending on the base style of beer, variety of honey and overall sweetness and strength. Beer flavors tend to somewhat mask typical honey flavors found in other meads.','eztext',1139,'eng-GB',2,0,'',1),(0,321,232,NULL,NULL,NULL,'ezinteger',1140,'eng-GB',2,0,'',1),(0,322,232,NULL,NULL,NULL,'ezinteger',1141,'eng-GB',2,0,'',1),(0,323,232,NULL,NULL,NULL,'ezfloat',1142,'eng-GB',2,0,'',1),(0,324,232,NULL,NULL,NULL,'ezfloat',1143,'eng-GB',2,0,'',1),(0,319,233,NULL,NULL,'Open Category Mead','ezstring',1144,'eng-GB',2,0,'open category mead',1),(0,320,233,NULL,NULL,'This mead should exhibit the character of all of the ingredients in varying degrees, and should show a good blending or balance between the various flavor elements. Whatever ingredients are included, the result should be identifiable as a honey-based fermented beverage.','eztext',1145,'eng-GB',2,0,'',1),(0,321,233,NULL,NULL,NULL,'ezinteger',1146,'eng-GB',2,0,'',1),(0,322,233,NULL,NULL,NULL,'ezinteger',1147,'eng-GB',2,0,'',1),(0,323,233,NULL,NULL,NULL,'ezfloat',1148,'eng-GB',2,0,'',1),(0,324,233,NULL,NULL,NULL,'ezfloat',1149,'eng-GB',2,0,'',1),(0,319,234,NULL,NULL,'Common Cider','ezstring',1150,'eng-GB',2,0,'common cider',1),(0,320,234,NULL,NULL,'Variable, but should be a medium, refreshing drink. Sweet ciders must not be cloying. Dry ciders must not be too austere. An ideal cider serves well as a session drink, and suitably accompanies a wide variety of food.','eztext',1151,'eng-GB',2,0,'',1),(0,321,234,NULL,NULL,NULL,'ezinteger',1152,'eng-GB',2,0,'',1),(0,322,234,NULL,NULL,NULL,'ezinteger',1153,'eng-GB',2,0,'',1),(0,323,234,5,NULL,NULL,'ezfloat',1154,'eng-GB',2,0,'',1),(0,324,234,8,NULL,NULL,'ezfloat',1155,'eng-GB',2,0,'',1),(0,319,235,NULL,NULL,'English Cider','ezstring',1156,'eng-GB',2,0,'english cider',1),(0,320,235,NULL,NULL,'Generally dry, full-bodied, austere.','eztext',1157,'eng-GB',2,0,'',1),(0,321,235,NULL,NULL,NULL,'ezinteger',1158,'eng-GB',2,0,'',1),(0,322,235,NULL,NULL,NULL,'ezinteger',1159,'eng-GB',2,0,'',1),(0,323,235,6,NULL,NULL,'ezfloat',1160,'eng-GB',2,0,'',1),(0,324,235,9,NULL,NULL,'ezfloat',1161,'eng-GB',2,0,'',1),(0,319,236,NULL,NULL,'French Cider','ezstring',1162,'eng-GB',2,0,'french cider',1),(0,320,236,NULL,NULL,'Medium to sweet, full-bodied, rich.','eztext',1163,'eng-GB',2,0,'',1),(0,321,236,NULL,NULL,NULL,'ezinteger',1164,'eng-GB',2,0,'',1),(0,322,236,NULL,NULL,NULL,'ezinteger',1165,'eng-GB',2,0,'',1),(0,323,236,3,NULL,NULL,'ezfloat',1166,'eng-GB',2,0,'',1),(0,324,236,6,NULL,NULL,'ezfloat',1167,'eng-GB',2,0,'',1),(0,319,237,NULL,NULL,'Common Perry','ezstring',1168,'eng-GB',2,0,'common perry',1),(0,320,237,NULL,NULL,'Mild. Medium to medium-sweet. Still to lightly sparkling. Only very slight acetification is acceptable. Mousiness, ropy/oily characters are serious faults.','eztext',1169,'eng-GB',2,0,'',1),(0,321,237,NULL,NULL,NULL,'ezinteger',1170,'eng-GB',2,0,'',1),(0,322,237,NULL,NULL,NULL,'ezinteger',1171,'eng-GB',2,0,'',1),(0,323,237,5,NULL,NULL,'ezfloat',1172,'eng-GB',2,0,'',1),(0,324,237,7,NULL,NULL,'ezfloat',1173,'eng-GB',2,0,'',1),(0,319,238,NULL,NULL,'Traditional Perry','ezstring',1174,'eng-GB',2,0,'traditional perry',1),(0,320,238,NULL,NULL,'Tannic. Medium to medium-sweet. Still to lightly sparkling. Only very slight acetification is acceptable. Mousiness, ropy/oily characters are serious faults.','eztext',1175,'eng-GB',2,0,'',1),(0,321,238,NULL,NULL,NULL,'ezinteger',1176,'eng-GB',2,0,'',1),(0,322,238,NULL,NULL,NULL,'ezinteger',1177,'eng-GB',2,0,'',1),(0,323,238,5,NULL,NULL,'ezfloat',1178,'eng-GB',2,0,'',1),(0,324,238,9,NULL,NULL,'ezfloat',1179,'eng-GB',2,0,'',1),(0,319,239,NULL,NULL,'New England Cider','ezstring',1180,'eng-GB',2,0,'new england cider',1),(0,320,239,NULL,NULL,'Substantial body and character.','eztext',1181,'eng-GB',2,0,'',1),(0,321,239,NULL,NULL,NULL,'ezinteger',1182,'eng-GB',2,0,'',1),(0,322,239,NULL,NULL,NULL,'ezinteger',1183,'eng-GB',2,0,'',1),(0,323,239,7,NULL,NULL,'ezfloat',1184,'eng-GB',2,0,'',1),(0,324,239,13,NULL,NULL,'ezfloat',1185,'eng-GB',2,0,'',1),(0,319,240,NULL,NULL,'Fruit Cider','ezstring',1186,'eng-GB',2,0,'fruit cider',1),(0,320,240,NULL,NULL,'Like a dry wine with complex flavors. The apple character must marry with the added fruit so that neither dominates the other.','eztext',1187,'eng-GB',2,0,'',1),(0,321,240,NULL,NULL,NULL,'ezinteger',1188,'eng-GB',2,0,'',1),(0,322,240,NULL,NULL,NULL,'ezinteger',1189,'eng-GB',2,0,'',1),(0,323,240,5,NULL,NULL,'ezfloat',1190,'eng-GB',2,0,'',1),(0,324,240,9,NULL,NULL,'ezfloat',1191,'eng-GB',2,0,'',1),(0,319,241,NULL,NULL,'Apple Wine','ezstring',1192,'eng-GB',2,0,'apple wine',1),(0,320,241,NULL,NULL,'Like a dry white wine, balanced, and with low astringency and bitterness.','eztext',1193,'eng-GB',2,0,'',1),(0,321,241,NULL,NULL,NULL,'ezinteger',1194,'eng-GB',2,0,'',1),(0,322,241,NULL,NULL,NULL,'ezinteger',1195,'eng-GB',2,0,'',1),(0,323,241,9,NULL,NULL,'ezfloat',1196,'eng-GB',2,0,'',1),(0,324,241,12,NULL,NULL,'ezfloat',1197,'eng-GB',2,0,'',1),(0,319,242,NULL,NULL,'Other Specialty Cider or Perry','ezstring',1198,'eng-GB',2,0,'other specialty cider or perry',1),(0,320,242,NULL,NULL,NULL,'eztext',1199,'eng-GB',2,0,'',1),(0,321,242,NULL,NULL,NULL,'ezinteger',1200,'eng-GB',2,0,'',1),(0,322,242,NULL,NULL,NULL,'ezinteger',1201,'eng-GB',2,0,'',1),(0,323,242,5,NULL,NULL,'ezfloat',1202,'eng-GB',2,0,'',1),(0,324,242,12,NULL,NULL,'ezfloat',1203,'eng-GB',2,0,'',1),(0,319,243,NULL,NULL,'American-Style Imperial Porter','ezstring',1204,'eng-GB',2,0,'american-style imperial porter',1),(0,320,243,NULL,NULL,'American-style imperial porters are black in color. No roast barley or strong burnt/astringent black malt character should be perceived. Medium malt, caramel and cocoa-like sweetness. Hop bitterness is perceived at a medium-low to medium level. Hop flavor and aroma may vary from being low to medium-high. This is a full bodied beer. Ale-like fruity esters should be evident but not overpowering and compliment hop character and malt derived sweetness. Diacetyl (butterscotch) levels should be absent.','eztext',1205,'eng-GB',2,0,'',1),(0,321,243,NULL,35,NULL,'ezinteger',1206,'eng-GB',2,35,'',1),(0,322,243,NULL,50,NULL,'ezinteger',1207,'eng-GB',2,50,'',1),(0,323,243,5,NULL,NULL,'ezfloat',1208,'eng-GB',2,0,'',1),(0,324,243,9,NULL,NULL,'ezfloat',1209,'eng-GB',2,0,'',1),(0,319,244,NULL,NULL,'Adambier','ezstring',1210,'eng-GB',2,0,'adambier',1),(0,320,244,NULL,NULL,'Adambier is light brown to very dark in color. It may or may not use wheat in its formulation. Original styles of this beer may have a low or medium low degree of smokiness. Smoke character may be absent in contemporary versions of this beer. Astringency of highly roasted malt should be absent. Toast and caramel-like malt characters may be evident. Low to medium hop bitterness are perceived. Low hop flavor and aroma are perceived. It is originally a style from Dortmund. Adambier is a strong, dark, hoppy, sour ale extensively aged in wood barrels. Extensive aging and the acidification of this beer can mask malt and hop character to varying degrees. Traditional and non-hybrid varieties of European hops were traditionally used. A Klsch-like ale fermentation is typical Aging in barrels may contribute some level of Brettanomyces and lactic character. The end result is a medium to full bodied complex beer in hop, malt, Brett and acidic balance.','eztext',1211,'eng-GB',2,0,'',1),(0,321,244,NULL,30,NULL,'ezinteger',1212,'eng-GB',2,30,'',1),(0,322,244,NULL,50,NULL,'ezinteger',1213,'eng-GB',2,50,'',1),(0,323,244,7,NULL,NULL,'ezfloat',1214,'eng-GB',2,0,'',1),(0,324,244,8,NULL,NULL,'ezfloat',1215,'eng-GB',2,0,'',1),(0,318,245,NULL,NULL,'Other Origin','ezstring',1216,'eng-GB',2,0,'other origin',1),(0,319,246,NULL,NULL,'Grodzisz','ezstring',1217,'eng-GB',2,0,'grodzisz',1),(0,320,246,NULL,NULL,'Grodzisz (also Grodziskie, and often referred to as Grtzer since WWII) is a Polish style of straw to golden colored ale. Chill haze is allowable at cold temperatures. The distinctive character comes from 100% oak wood smoked wheat malt. The overall balance is a sessionably medium to medium-high assertively oak- smoky malt emphasized beer. Aroma is dominated by oak smoke notes. They have a medium low to medium perceived clean hop bitterness. European noble hop flavor notes are very low to low, and low ester may also be present. Body is low to medium low. A Klsch-like ale fermentation and aging process lends a crisp overall flavor impression and low degree of ester fruitiness. Sourness, diacetyl, and sweet corn-like DMS (dimethylsulfide) should not be perceived. Historic versions were most often bottle conditioned to relatively high carbonation levels.','eztext',1218,'eng-GB',2,0,'',1),(0,321,246,NULL,15,NULL,'ezinteger',1219,'eng-GB',2,15,'',1),(0,322,246,NULL,25,NULL,'ezinteger',1220,'eng-GB',2,25,'',1),(0,323,246,2,NULL,NULL,'ezfloat',1221,'eng-GB',2,0,'',1),(0,324,246,2,NULL,NULL,'ezfloat',1222,'eng-GB',2,0,'',1),(0,318,247,NULL,NULL,'Malternative Beverages','ezstring',1223,'eng-GB',2,0,'malternative beverages',1),(0,319,248,NULL,NULL,'Flavored Malt Beverage','ezstring',1224,'eng-GB',2,0,'flavored malt beverage',1),(0,320,248,NULL,NULL,'Flavored malt beverages are brewery products that are different from traditional malt beverages like malt liquor, ales, and lagers in several aspects. Flavored malt beverages exhibit little or no traditional beer or malt beverage flavor characteristics. Their flavor is primarily derived from added flavoring rather than from malt and other materials used in fermentation. However,  flavored malt beverages are marketed in traditional beer bottles and cans and distributed to the alcohol beverage market through beer and malt beverage wholesalers. Their alcohol content is similar to other malt beverages in the range of 4-6% alcohol by volume.','eztext',1225,'eng-GB',2,0,'',1),(0,321,248,NULL,NULL,NULL,'ezinteger',1226,'eng-GB',2,0,'',1),(0,322,248,NULL,NULL,NULL,'ezinteger',1227,'eng-GB',2,0,'',1),(0,323,248,4,NULL,NULL,'ezfloat',1228,'eng-GB',2,0,'',1),(0,324,248,6,NULL,NULL,'ezfloat',1229,'eng-GB',2,0,'',1),(0,319,249,NULL,NULL,'Energy Enhanced Malt Beverage','ezstring',1230,'eng-GB',2,0,'energy enhanced malt beverage',1),(0,320,249,NULL,NULL,'Energy enhanced malt beverages are alcoholic drinks that are supplemented with caffeine or other stimulants such as guarana, ginseng, or taurine.  At a minimum, these beverages contain at least one percent of alcohol by volume.','eztext',1231,'eng-GB',2,0,'',1),(0,321,249,NULL,NULL,NULL,'ezinteger',1232,'eng-GB',2,0,'',1),(0,322,249,NULL,NULL,NULL,'ezinteger',1233,'eng-GB',2,0,'',1),(0,323,249,1,NULL,NULL,'ezfloat',1234,'eng-GB',2,0,'',1),(0,324,249,NULL,NULL,NULL,'ezfloat',1235,'eng-GB',2,0,'',1);
